(188, 4, '2014-02-20 16:51:46', 'Discover Card Validation Patch Available', 'A patch that resolves an issue with validating Discover credit cards is now available for download at http://www.magentocommerce.com/download. More information on the patch is available in the Magento Knowledge Base at http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation', 'http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation ', 0, 0),
(189, 4, '2014-03-04 14:12:26', 'Learn How to Quickly Increase Sales on Your Site', 'Adding the PayPal Express Checkout button to your checkout page can help increase sales 18% on average. It’s fast and easy and you can do it right now to boost sales. Express Checkout is already seamlessly integrated into Community Edition.', 'http://magento.com/paypal/CE_Express_Checkout_NA?utm_source=messagemodule&utm_medium=message&utm_campaign=Ceexpresscheckout', 0, 0),
(190, 4, '2014-05-13 14:46:11', 'Magento Community Edition 1.9 is now available!', 'It accelerates your entry into the mobile commerce space by slashing the time and cost of getting a mobile device-friendly responsive site.  And a new Bill Me Later payment option helps boost your sales. Visit http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time to learn more.', 'http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time', 0, 0),
(191, 4, '2014-09-23 04:50:48', 'eBay Enterprise Display and Affiliate services can turbocharge your holiday sales. Learn how.', 'Learn more at www.ebayenterprise.com/turbochargesales.  DID YOU KNOW: Over 128 million shoppers visit eBay.com each month in Q4--and you can reach these highly qualified shoppers with eBay Enterprise Display. Also Magento merchants who use product-based retargeting ads average at least $5 in sales for every $1 in Retargeting spend. And on the Affiliate Network, you get access to over 200,000 active network publishers across 20+ promotional categories and 30+ verticals, and only pay when a consumer makes a purchase (Affiliate Network is only available in the U.S. & Canada). GET STARTED TODAY by visiting www.ebayenterprise.com/turbochargesales.', 'http://www.ebayenterprise.com/turbochargesales', 0, 0),
