(1141, 10, 104, 0, 250, 'Cassata-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Angebote, Angebote'),
(1142, 10, 97, 0, 250, 'Rumgetränkter Biskuit, Amarenakirschen, Sultaninen, in Cointreau eingelegte Mandarinen und kandierte Kirschen werden mit einer Kirschwassercreme vermengt. Umhüllt wird diese feine Mischung von einer mit Zartbitterschokolade überzogenen Marzipandecke. Der Boden besteht aus einem lockeren Nussbiskuit.\r\n \r\n'),
(1143, 10, 506, 0, 250, 'Neu in unserem Versand! \r\nEine Torte für den Rumpunschliebhaber!\r\nØ 26cm'),
(1144, 10, 531, 0, 250, NULL),
(1145, 10, 104, 0, 251, 'Neu Strohauers Ostertorte, Onlineshop, Onlineshop, Ostern, Ostern, Kuchen & Torten, Kuchen & Torten, Traditionelle Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1146, 10, 97, 0, 251, 'Ein Mürbteig und dünne Biskuitböden werden mit Schokocreme und Kirschen gefüllt. Eingehüllt mit gelben Marzipan und dekoriert mit Marzipanblumen und Eiern, versüßt diese schöne Torte Ihr Osterfest. Die Deko wird seperat mitgeliefert. Sie können die Deko selbst mit Marmelade auf der Torte anbringen. Ohne Alkohol.\r\nØ 20cm Gewicht 1500g'),
(1147, 10, 506, 0, 251, 'Ein schöner Blickfang für Ihre Ostertafel.'),
(1148, 10, 531, 0, 251, NULL),
(1149, 10, 104, 0, 252, 'Königin-Silvia-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Traditionelle Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1150, 10, 97, 0, 252, 'Altfranzösischer saftiger Biskuit, wird reichlich getränkt mit Kirschwasser, eingedeckt mit Marzipan und überzogen mit weißer Schokolade. Als Boden dient ein knuspriger Mürbeteig. Frische Pistazien und Belegkirschen runden diese Kreation ab. '),
(1151, 10, 506, 0, 252, 'Anlässlich zur Hochzeit des Schwedischen Königspaares wurde diese Torte 1976 kreiert und dann dem Paar überreicht. Jetzt haben wir diese königliche Torte wieder im Programm.\r\nGewicht 1600g Ø 26cm'),
(1152, 10, 531, 0, 252, NULL),
(1153, 10, 104, 0, 253, 'Pistazien Marzipan Stollen 1000 g, Produkte, Weihnachten'),
(1154, 10, 97, 0, 253, '<div class="std">Der Stollen wird aus feinem Butterteig hergestellt, der eine  saftige Marzipanrolle umh&uuml;llt. Nach dem Backen wird er mit einer  Aprikosen-Konfit&uuml;re bestrichen und mit vielen gehackten, frischen  Pistazien bestreut.</div>'),
(1155, 10, 506, 0, 253, '<p>Kenner lieben dieses Naschwerk</p>'),
(1156, 10, 531, 0, 253, NULL),
(1157, 10, 104, 0, 254, 'Marzipan Mandel Stollen 1000g, Produkte, Weihnachten'),
(1158, 10, 97, 0, 254, '<div class="std">Der zarte Butterteig wird aus vielen gehackten Mandeln hergestellt und mit einer saftigen Marzipanrolle gef&uuml;llt. Nach  dem Backen wird der Stollen gebuttert und mit Vanille- und Puderzucker  best&auml;ubt.</div>'),
(1159, 10, 506, 0, 254, '<p>Eine Alternative zum original Heidelberger Christstollen</p>'),
(1160, 10, 531, 0, 254, NULL),
(1161, 10, 104, 0, 255, 'Strohauer`s Original Heidelberger Christstollen 1500 g'),
(1162, 10, 97, 0, 255, '<p>In 180 L&auml;ndern auf allen Kontinenten gilt Strohauer''s Christstollen als  "Botschafter aus Heidelberg" - und das nicht ohne Grund! Erlesene  Zutaten wie die gr&ouml;&szlig;ten, saftigsten, 48 Stunden in Rum geweichten  Sultaninen, Vanille, Mandeln, Orangeat, Zitronat, Rohmarzipan und  exotische Gew&uuml;rze verleihen ihm seine aromatische Saftigkeit. Verpackt in einer weihnachtlichen Tüte.'),
(1163, 10, 506, 0, 255, '<p>Er darf auf keiner Festtafel fehlen</p>'),
(1164, 10, 531, 0, 255, NULL),
(1165, 10, 104, 0, 256, 'Präsent Advent, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente'),
(1166, 10, 97, 0, 256, 'Marzipan-Mandelstollen 500 gr, eine kl. Flasche (0,2l) Palio Natale Secco, und 6 Weihnachtspralinen mit Alkohol ( können variieren) haben wir in einem schönen Weihnachtspräsentkarton zusammen gestellt.'),
(1167, 10, 506, 0, 256, 'Für einen gemütlichen Abend daheim'),
(1168, 10, 531, 0, 256, NULL),
(1169, 10, 104, 0, 257, 'Präsent Christkindel, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente'),
(1170, 10, 97, 0, 257, 'Pistazienstollen (500 gr.), eine kl. Flasche (0,2l) Palio Natale Secco, 6 Weihnachtspralinen mit Alkohol ( können variieren), und ein Ring Baumkuchen (ca. 150 gr) haben wir für Sie in einem weihnachtlichen Geschenkkarton zusammen gestellt.'),
(1171, 10, 506, 0, 257, 'Eine bunte Zusammenstellung diverser Weihnachtsartikel'),
(1172, 10, 531, 0, 257, NULL),
(1173, 10, 104, 0, 258, 'gemischte Weihnachtskiste, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente'),
(1174, 10, 97, 0, 258, 'Marzipan-Mandelstollen (500 gr), Früchtebrot (500 gr.) eine kl. Flasche (0,2l) Palio Natale Secco, 6 Weihnachtspralinen mit Alkohol in einer Schachtel (können variieren) und ein Ring Baumkuchen (ca. 150 gr) wird in einen wunderschönen Geschenkkarton verpackt.'),
(1175, 10, 506, 0, 258, 'weihnachtliche Spezialitäten haben wir zu einem schönen Präsent zusammen gestellt.'),
(1176, 10, 531, 0, 258, NULL),
(1177, 10, 104, 0, 259, 'Deutsch-Französische Freundschaft, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente'),
(1178, 10, 97, 0, 259, 'Dieser Wein kommt aus der Kellerei Maison Rigal, die seit 1755 der Spezialist für Weine aus dem Südwesten Frankreichs ist.\r\nRebsorte: 100% Gros Manseng \r\nGoldene Farbe. Intensives Bukett, in dem sich Noten von getrockneten Aprikosen und exotischen Früchten mischen. Am Gaumen sehr schön ausgewogen, mit Aromen von kandierten Früchten,Quitten, Feigen und Honig. Durch die feine Säure wirkt der Wein wunderbar erfrischend im Abgang. \r\nAls Aperitif, zu Desserts oder einfach zum Geniesen.\r\nReferenzen: Goldmedaille Concours National des Vins IGP de France 2012 für den 2011er.'),
(1179, 10, 506, 0, 259, 'Diesen lieblichen Wein haben wir mit einem 500 gr. Mandelmarzipanstollen und edlen Weihnachtspralinen kombiniert und in einen weihnachtlichen Geschenkkarton verpackt.'),
(1180, 10, 531, 0, 259, NULL),
(1181, 10, 104, 0, 260, 'Deutsch-französische Komposition'),
(1182, 10, 97, 0, 260, 'ca. 150 km. südöstlich von Bordeaux kommt dieser köstliche Sauvignon.Das Weingut Maison Rigal ist seit 1755 der Spezialist für Weine aus dem Südwesten Frankreichs.\r\nLeuchtende Farbe mit hellgelben Reflexen. Intensiver, lebhafter Duft mit blumigen Noten. Im Mund kräftig und trocken mit Aromen von Stchelbeere, Passionsfrüchte und Pampelmuse. \r\nIdealer Begleiter von Spargel, Schalen und Krustentieren, Fisch und auch Geflügelgerichten.\r\nDiesen Excellenten Wein haben wir mit unserem Christstollen und feinen Weihnachtspralinen kombiniert.'),
(1183, 10, 506, 0, 260, 'Ein excellenter Wein kombiniert mit unserem außergewöhnlichen Heidelberger Christstollen (500 gr.), und 6 Weihnachtspralinen.\r\nSie können uns auch anrufen und aus unserem reichhaltigen Angebot sich selbst ein Präsent zusammenstellen.'),
(1184, 10, 531, 0, 260, NULL),
(1185, 10, 104, 0, 261, 'Nashorn-Jubiläumstorte, Onlineshop, Jubiläum, Festliche Anlässe'),
(1186, 10, 97, 0, 261, 'Diese Torte war für das Augustinum. Die Nashörner haben wir selbst aus Marzipan hergestellt. Jedes Stockwerk hat eine andere Füllung. '),
(1187, 10, 506, 0, 261, 'Nur für Selbstabholer'),
(1188, 10, 531, 0, 261, NULL),
(1189, 10, 104, 0, 262, 'Weiße Dame, Onlineshop, Hochzeit, Festliche Anlässe'),
(1190, 10, 97, 0, 262, 'Diese Hochzeitstorte besticht durch ihre Eleganz. Sie bestand aus den Füllungen: Schwarzwäldertorte, Nußsahnetorte und Käsesahnetorte. Die Marzipanblumen werden farblich Ihrer Tischdeko angepasst. Sie können die Füllungen natürlich auch nach Ihrem Geschmack bestellen. Für ca 60 Personen'),
(1191, 10, 506, 0, 262, 'Nur für Selbstabholer '),
(1192, 10, 531, 0, 262, NULL),
(1193, 10, 104, 0, 263, 'Weihnachtszeit, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente'),
(1194, 10, 97, 0, 263, 'Unser beliebter Strohauers Original Heidelberger Christstollen haben wir mit einer Flasche Palio Natale Secco kombiniert. Mit Alkohol (Christstollen 1000 g. Secco 0,750l)'),
(1195, 10, 506, 0, 263, 'Der besondere Genuss zur Weihnachtszeit'),
(1196, 10, 531, 0, 263, NULL),
(1197, 10, 104, 0, 264, 'Große Viktoria-Torte, Hochzeitstorten'),
(1198, 10, 97, 0, 264, 'Die Viktoriatorte können Sie in verschiedenen Größen als Hochzeitstorte bestellen, daher variiert auch der Preis.'),
(1199, 10, 506, 0, 264, 'für Selbstabholer\r\nPersonenzahl beliebig Nur auf Bestellung'),
(1200, 10, 531, 0, 264, NULL),
(1201, 10, 104, 0, 265, 'Großes Erdbeerherz, Hochzeitstorten'),
(1202, 10, 97, 0, 265, 'In der Saison! Ein großes Erdbeerherz.'),
(1203, 10, 506, 0, 265, 'Nur für Selbstabholer\r\n40-50 Personen Auf Anfrage'),
(1204, 10, 531, 0, 265, NULL),
(1205, 10, 104, 0, 266, 'Dreistöckige Hochzeitstorte mit Blumenbukett, Hochzeitstorten'),
(1206, 10, 97, 0, 266, 'Diese Hochzeitstorte besticht durch ihre Eleganz. Selbstverständlich können Sie jedes Stockwerk mit einer anderen Geschmacksrichtung füllen lassen. Das Zuckerbukett kann man nicht mitessen. Die Torte wurde mit einem weichen Fondant eingeschlagen.'),
(1207, 10, 506, 0, 266, 'Nur für Selbstabholer\r\n50-60 Personen Nur auf Bestellung'),
(1208, 10, 531, 0, 266, NULL),
(1209, 10, 104, 0, 267, 'Hochzeitstorte , Hochzeitstorten'),
(1210, 10, 97, 0, 267, 'Diese aufgesetzte Hochzeitstorte bestand aus einer Sachertorte und einer Viktoriatorte. Überzogen wurde sie mit einem weichen Fondant.'),
(1211, 10, 506, 0, 267, 'Nur für Selbstabholer \r\nfür ca. 15 Personen Nur auf Bestellung'),
(1212, 10, 531, 0, 267, NULL),
(1213, 10, 104, 0, 268, 'Doppelherz mit Himbeeren, Hochzeitstorten'),
(1214, 10, 97, 0, 268, 'Das eine Herz besteht aus einer Himbeersahne, belegt mit frischen Himbeeren. Das andere Herz aus einer Sachertorte. Natürlich können sie auch eine andere Füllung bestimmen.'),
(1215, 10, 506, 0, 268, 'Nur für Selbstabholer\r\n50-60 Personen Nur auf Bestellung'),
(1216, 10, 531, 0, 268, NULL),
(1217, 10, 104, 0, 269, 'Viereckige Hochzeitstorte mit Herz, Hochzeitstorten'),
(1218, 10, 97, 0, 269, 'Bei dieser Hochzeitstorte richten wir uns natürlich auch nach Ihren Wünschen. Diese wurde Torte wurde mit Marzipan überzogen. Die Geschmacksrichtung war Erdbeer- Joghurt. Das Herz war unsere beliebte Sachertorte.'),
(1219, 10, 506, 0, 269, 'Nur für Selbstabholer\r\n50-60 Personen Nur auf Bestellung'),
(1220, 10, 531, 0, 269, NULL),
(1221, 10, 104, 0, 270, 'Schwarz-weiße Hochzeitstorte, Hochzeitstorten'),
(1222, 10, 97, 0, 270, 'Bei dieser 5 stöckigen Hochzeitstorte können für jedes Stockwerk eine andere Geschmacksrichtung aussuchen. Diese hier bestand nur aus fruchtiger Füllung. zB. Mangosahne, Himbeersahne  Erdbeer-Joghurt, Mandarinensahne und Viktoriatorte.'),
(1223, 10, 506, 0, 270, 'Nur für Selbstabholer!!!\r\n60-70 Personen Nur auf Bestellung'),
(1224, 10, 531, 0, 270, NULL),
(1225, 10, 104, 0, 271, 'Doppelherz, Hochzeitstorten'),
(1226, 10, 97, 0, 271, 'Doppelherz in weiß und rot gehalten. Geschmacksrichtung und Verziehrung können Sie nach Belieben selbst bestimmen. Diese Torte war eine Sachermasse und das andere Herz war eine Viktoriatorte. Überzogen war sie mit einem weichen Zuckerfondant.'),
(1227, 10, 506, 0, 271, 'Nur für Selbstabholer\r\n50-60 Personen Nur auf Bestellung'),
(1228, 10, 531, 0, 271, NULL),
(1229, 10, 104, 0, 272, 'Käse-Mohn Kuchen, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1230, 10, 97, 0, 272, 'Wer keinen Mohn mag, kann auch auf die Käse-Kirsch Variante ausweichen.\r\nZutaten wie unser Käse- Rahm Kuchen nur noch mit einer Schicht Kirschmasse. '),
(1231, 10, 506, 0, 272, '26 cm Ø 1850 g\r\nEine andere Variante zum Käse-Mohn. '),
(1232, 10, 531, 0, 272, NULL),
(1233, 10, 104, 0, 273, 'Käse-Mohn Kuchen, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1234, 10, 97, 0, 273, 'Zutaten wie unser Käse- Rahm Kuchen nur noch mit einer Schicht Mohn.  '),
(1235, 10, 506, 0, 273, '26 cm Ø 1850 g\r\nUnser leckerer Käse-Rahm Kuchen wird mit einer Schicht Mohn zu einem vollkommenen neuen Geschmackserlebnis'),
(1236, 10, 531, 0, 273, NULL),
(1237, 10, 104, 0, 274, '"Wochenendkuchen" Linzertorte NEU, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1238, 10, 97, 0, 274, 'Unsere Linzertorte wird nur mit ausgesuchten Rohstoffen und Gewürzen nach einem alten Rezept, hergestellt. Makronenmasse, Butter,Zucker, Eier,Mandeln,Nüsse,Mehl und Gewürze werden zu einem saftigen Teig verknetet. Gefüllt wird die Torte mit einer feinen Himbeer-Johannisbeer Marmelade. Auch ohne Kühlung lange haltbar!\r\n'),
(1239, 10, 506, 0, 274, 'Ein unvergleichlicher Genuss;- nicht nur zur Winterzeit\r\n 26 cm Ø 1350 g  '),
(1240, 10, 531, 0, 274, NULL),
(1241, 10, 104, 0, 275, 'Tortenaufleger, Onlineshop, Foto & Bilder Torten'),
(1242, 10, 97, 0, 275, 'Möchten Sie für Ihre Torte einen passenden Bildaufleger? Hier haben Sie die Möglichkeit einen Aufleger zu bestellen. Und so funktioniert es: Laden Sie ein druckfertiges Bild zu uns hoch oder schicken es uns mit der Post. Wir drucken das Bild mit Lebensmittelfarbe für Sie auf Esspapier.'),
(1243, 10, 506, 0, 275, 'Größe: Bildaufleger Ø 20cm ; 18 x 18cm; 20 x 29cm ohne Bearbeitung;- das heißt Sie schicken uns ein fertiges Bild und wir drucken es nur aus.'),
(1244, 10, 531, 0, 275, NULL),
(1245, 10, 104, 0, 276, 'Muttertagstorte, Onlineshop, Valentinstag & Muttertag, Angebote'),
(1246, 10, 97, 0, 276, '<p>Die geschmackvolle Torte besteht aus einer feinen Mandel-Marzipanmasse, reichlich gef&uuml;llt mit einer feinen Orangencreme. Eingestrichen wird sie mit einer Creme und mit gelben Marzipan eingedeckt. Mit dem Frühlingsbild ist sie ein echter Hingucker.\r\nØ 20cm Gewicht Netto ca.800g'),
(1247, 10, 506, 0, 276, 'Überraschen Sie Ihre Mutter mit dieser schmackhaften Torte'),
(1248, 10, 531, 0, 276, NULL),
(1249, 10, 104, 0, 277, 'Frühlingstorte, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten, Angebote'),
