(1326, 10, 97, 0, 296, 'Der saftige Sacherboden wird mit Aprikosenmarmelade gefüllt und mit Nougat überzogen. Eingeschlagen wird die Torte mit Marzipan. Das Bild wird mit Lebensmittelfarbe auf Esspapier gedruckt. Sie können die Torte auch als Nussgeschmack bekommen. <p>Saftige, aromatisch gew&uuml;rzte und exquisit gef&uuml;llte Nusstorte mit vielen  frisch gemahlenen Haseln&uuml;ssen. Dünn gef&uuml;llt wird die klassische Nusstorte mit  einer leichten Vanillecreme und Himbeer/Johannisbeermarmelade, überzogen mit feiner Zartbitterschokolade.</p> NICHT VERSANDFÄHIG'),
