(1349, 10, 104, 0, 302, 'Strohauer`s Früchtebrot'),
(1350, 10, 97, 0, 302, 'Kleingeschnittene, getrocknete Zwtschgen, Birnen, Feigen und Datteln werden über Nacht eingeweicht. Der Teig aus Zitronat, Orangeat, Rosinen, Nüssen, Zucker, Mehl, Hefe, Gewürzen(Zitrone,Salz,Zimt,Nelken) und etwsa Rum wird mit dem eingeweichten Trockenobst gemischt, mit der Hand geformt und anschließend schonend gebacken. Zum Schluss wird das Früchtebrot mit weißer Kuvertüre überzogen, und mit Mandeln und einer Belegkirsche verziert. (ohne Konservierungsstoffe und ohne künstlichen Aromen.)'),
