(1362, 10, 97, 0, 305, '<div class="std">Feinste Pralinen und Tr&uuml;ffel ca. 300 g hergestellt  aus  hochwertigen Rohstoffen. Die Pralinenf&uuml;llungen werden stets frisch und  nur aus besten Zutaten zubereitet. Ein Geschmackserlebnis das auf der  Zunge zergeht. Die Pralinen werden in einer dekorativen Buchformdose  verpackt.</div> Mit Alkohol'),
(1363, 10, 506, 0, 305, '<p>300 g<br /> Pralinen die auf der Zunge zergehen</p>'),
(1364, 10, 531, 0, 305, NULL),
(1365, 10, 104, 0, 306, 'Elisen Lebkuchen, Produkte, Weihnachten'),
