(1367, 10, 506, 0, 306, '<p>400 g Netto<br /> Ob schokoliert oder glasiert.... immer ein Gedicht</p>'),
(1368, 10, 531, 0, 306, NULL),
(1369, 10, 104, 0, 307, 'Zimtsterne, Produkte, Weihnachten'),
(1370, 10, 97, 0, 307, '<div class="std">Feinster Marzipan mit frisch gemahlenen Mandeln und N&uuml;ssen,  duftender Zimt, werden mit einer aufgeschlagenen Eiwei&szlig;-Glasur einzeln  von Hand ausgestochen. Das sorgsame Backen und die Abstimmung aller  Zutaten nach einem uralten Rezept garantiert die w&uuml;rzige, feucht-saftige  Geschmacksh&uuml;lle dieser traditionellen Weihnachts-Spezialit&auml;t. 500 Gramm  in einer wundersch&ouml;nen Weihnachtsdose.</div>'),
(1371, 10, 506, 0, 307, '<p>500g<br /> Eine wundersch&ouml;ne Dose mit leckeren Zimtsternen</p>'),
(1372, 10, 531, 0, 307, NULL),
(1373, 10, 104, 0, 308, 'Adventspaket, Produkte, Weihnachten'),
(1374, 10, 97, 0, 308, '<div class="std">Wundervolle weihnachtliche Geb&auml;ckmischung bestehend aus  traditionellen Geb&auml;cksorten wie Zimtsterne, Buttergeb&auml;ck, Anispl&auml;tzchen,  Haselnussmakronen, Baumkuchenspitzen, Vanillekipferl, B&auml;rentatzen und  Zedernhalbmonde.</div>'),
(1375, 10, 506, 0, 308, '<p>1000 g Netto<br /> Wundervolle weihnachtliche Geb&auml;ckmischung bestehend aus traditionellen Geb&auml;cksorten....</p>'),
(1376, 10, 531, 0, 308, NULL),
