(1380, 10, 531, 0, 309, NULL),
(1381, 10, 104, 0, 310, 'Strohauer`s Weihnachtstorte, Produkte, Weihnachten'),
(1382, 10, 97, 0, 310, '<div class="std">Saftige, dunkle Gew&uuml;rzkuchenmasse erh&auml;lt ihr k&ouml;stliches Aroma  durch die traditionellen weihnachtlichen Gew&uuml;rze, Zimt, besten Kakao,  N&uuml;sse und Mandeln. Gef&uuml;llt mit Aprikosenmarmelade, eingestrichen mit  Nuss-Nougat-Creme und &uuml;berzogen mit Vollmilchschokolade. Dekoriert wird  die Torte mit einem stimmungsvollen Marzipan-Dekoraufleger.</div>'),
(1383, 10, 506, 0, 310, '<p>28 cm &Oslash; 1500 g Netto<br /> Diese weihnachtliche Torte verziehrt jede Festtafel.</p>'),
(1384, 10, 531, 0, 310, NULL),
(1385, 10, 104, 0, 311, 'Kleine Weihnachtstorte, Produkte, Weihnachten'),
