(1396, 10, 531, 0, 313, NULL),
(1397, 10, 104, 0, 314, 'Strohauer`s Original Heidelberger Christstollen 1000 g, Produkte, Weihnachten'),
(1398, 10, 97, 0, 314, '<div class="std">In 180 L&auml;ndern auf allen Kontinenten gilt Strohauer''s  Christstollen als "Botschafter aus Heidelberg" - und das nicht ohne  Grund! Erlesene Zutaten wie die gr&ouml;&szlig;ten, saftigsten, 48 Stunden in Rum  geweichten Sultaninen, Vanille, Mandeln, Orangeat, Zitronat, Rohmarzipan  und exotische Gew&uuml;rze verleihen ihm seine aromatische Saftigkeit. Jeder  Christstollen erreicht seinen Empf&auml;nger unbeschadet in einem  wundersch&ouml;nen Geschenkkarton und verleiht "festliche" Stimmung!!</div>'),
(1399, 10, 506, 0, 314, '<div class="std">Er darf auf keiner Festtafel fehlen</div>'),
(1400, 10, 531, 0, 314, NULL),
