(1409, 10, 104, 0, 317, 'Osterpralinen, Produkte, Ostern'),
(1410, 10, 97, 0, 317, '<div class="std">Lassen Sie sich von unseren handgefertigten Osterpralinen  verf&uuml;hren. F&uuml;r Sie haben wir eine kleine Auswahl aus unserem Sortiment  in einer Klarsicht-Pr&auml;sentpackung zusammengestellt. Gef&uuml;llt sind die  Osterpralinen mit: Mandelcreme; Haselnuss-Creme; Wachtelei mit  Haselnuss-Creme; Capuccino-Tr&uuml;ffelmasse;Marzipan und Amarena-Kirschen;  Edelvollmilch; Himbeercreme; Kirsch-Gelee mit Cherry;  Eierlik&ouml;r;Orangenmarzipan und Bourbon-Vanille.</div>'),
