(1412, 10, 531, 0, 317, NULL),
(1413, 10, 104, 0, 318, 'Baumkuchen Osternest, Produkte, Ostern'),
(1414, 10, 97, 0, 318, '<div class="std">Das Osternest wird Schicht f&uuml;r Schicht aus zartem Baumkuchenteig  am offenem Feuer gebacken und sorgf&auml;ltig mit feinstem Edelfondant  &uuml;berzogen. In der Mitte sitzt ein Osterh&auml;schen aus leckerer  Edelvollmilchschokolade, kleine Tr&uuml;ffel- und Marzipank&ouml;stlichkeiten  liegen zum Verteilen dabei. Das Baumkuchen Osternest ist nicht nur ein  wahrer Augenschmaus f&uuml;r Ihre &ouml;sterliche Kaffeetafel, sondern auch eine  ganz besonders schmackhafte Kuchenspezialit&auml;t.</div>'),
(1415, 10, 506, 0, 318, '<p>H&ouml;he 11 cm 600g<br /> Ein Augenschmaus f&uuml;r Ihre &ouml;sterliche Kaffeetafel</p>'),
(1416, 10, 531, 0, 318, NULL),
(1417, 10, 104, 0, 319, 'Strohauer`s Osterlamm, Produkte, Ostern'),
(1418, 10, 97, 0, 319, '<div class="std">&Uuml;berraschen Sie Ihre Familie oder Ihre G&auml;ste mit diesem  originellen Osterlamm. Aus leichtem Butter-Biskuit wird es nach einem  alten &uuml;berlieferten franz&ouml;sischen Rezept aus Butter, Zucker, Eiern und  Mehl gebacken. Mit seinem flaumigen Puderzuckerfell wird es  unwiderstehlich und bildet einen geschmackvollen Mittelpunkt des  traditionellen Osterfestes.</div>'),
(1419, 10, 506, 0, 319, '<p>500g Netto<br /> Zum Anschneiden fast zu schade</p>'),
(1420, 10, 531, 0, 319, NULL),
(1421, 10, 104, 0, 320, 'Ostertelegramm Motiv 1, Produkte, Ostern'),
(1422, 10, 97, 0, 320, '<div class="std">Ein ausgefallenes Geschenk f&uuml;r Ostern. .Hinter den s&uuml;&szlig;en  Ostergr&uuml;&szlig;en steckt eine Torte aus saftigem Marzipan-Biskuit, der mit  einer Kirschwassercreme gef&uuml;llt ist und mit wei&szlig;er Schokolade &uuml;berzogen  wird.</div>'),
(1423, 10, 506, 0, 320, '<p>18 x 18 x 5 cm 1000g Netto<br /> Diese Ostertorte wird nicht nur begeistern, sondern auch schmecken.<br /> mit Alkohol</p>'),
(1424, 10, 531, 0, 320, NULL),
(1425, 10, 104, 0, 321, 'Viereckige Ostertorte – NEU, Produkte, Ostern'),
(1426, 10, 97, 0, 321, '<div class="std">Der saftige Biskuit wird gef&uuml;llt mit einer leckeren Vanillecreme.  Die Torte wird mit Creme eingestrichen und mit gr&uuml;nem Marzipan eingeschlagen. Ein wundersch&ouml;nes Esspapierdekor  in der Gr&ouml;&szlig;e 24/16 cm runden  die Tortenkreation ab</div>'),
(1427, 10, 506, 0, 321, '<p>Gr&ouml;&szlig;e ca.  20/29 cm. 2000g Netto<br /> Osterverf&uuml;hrung<br /> ohne Alkohol</p>'),
(1428, 10, 531, 0, 321, NULL),
(1429, 10, 104, 0, 322, 'Häschen-Ostertorte, Produkte, Ostern'),
(1430, 10, 97, 0, 322, '<div class="std">Eine &ouml;sterliche Verf&uuml;hrung ist diese feine H&auml;schen-Ostertorte.  Der saftige Schokoladenbiskuit wird gef&uuml;llt mit einer Schokoladencreme  u. Aprikosenmarmelade. Die Torte wird mit Nougat eingestrichen und mit  gr&uuml;nem Marzipan eingeschlagen. 12 R&uuml;blis &amp; ein Marzipanaufleger  runden das Bild der Torte ab.</div>'),
(1431, 10, 506, 0, 322, '<p>28 cm &Oslash; 1500g Netto<br /> Eine sehr leckere Ostertorte f&uuml;r Ihre Kaffetafel<br /> ohne Alkohol</p>'),
(1432, 10, 531, 0, 322, NULL),
(1433, 10, 104, 0, 323, 'Sachertorte mit Aufleger und 10 kleinen Kerzen, Geburtstage, Produkte, Jubiläum, Festliche Anlässe'),
(1434, 10, 97, 0, 323, '<p>Unsere beliebte Sachertorte wird mit 10 kleinen Kerzchen und einem Aufleger nach Ihrer Wahl geschm&uuml;ckt.</p>'),
(1435, 10, 506, 0, 323, '<p>20 cm &Oslash; 800 g Netto<br /> Sachertorte mit Aufleger und 10 kleinen Kerzen<br /> ohne Alkohol</p>'),
(1436, 10, 531, 0, 323, NULL),
(1437, 10, 104, 0, 324, 'Viereckige Kindertorte - NEU, Geburtstage, Produkte, Festliche Anlässe'),
(1438, 10, 97, 0, 324, '<div class="std">Zwischen d&uuml;nnen Biskuitlagen kommt abwechselnd eine feine  Schoko- und Erdbeercremef&uuml;llung. &Uuml;berzogen wird die Torte mit rotem  Marzipan. Die Dekoration der Torte wird mit Bl&uuml;mchen geschm&uuml;ckt. Nat&uuml;rlich darf  eine Hello-Kitty oder Spongebob Figur als Spardose nicht fehlen.  Sie k&ouml;nnen die Torte auch als unsere beliebte Sachertorte bestellen! Die Figur ist nicht essbar.</div>'),
(1439, 10, 506, 0, 324, '<p>ca. 20/29 cm 2000g<br /> Ein Traum f&uuml;r Hello-Kitty oder Spongebob begeisterten Kindern<br /> ohne Alkohol</p>'),
(1440, 10, 531, 0, 324, NULL),
(1441, 10, 104, 0, 325, 'Kindergeburtstagstorte rund - NEU, Geburtstage, Produkte, Festliche Anlässe'),
(1442, 10, 97, 0, 325, '<div class="std">Zwischen d&uuml;nnen Biskuitlagen kommt abwechselnd eine feine Schoko- und Erdbeercremef&uuml;llung.  &Uuml;berzogen wird die Torte mit rotem Marzipan. Geschm&uuml;ckt wird die Torte mit Hello-Kitty Figuren. Die Figuren sind nicht essbar.</div>'),
(1443, 10, 506, 0, 325, '<p>20 cm &Oslash; 800 g Netto<br /> Ein Augenschmaus f&uuml;r Kinder<br /> ohne Alkohol</p>'),
(1444, 10, 531, 0, 325, NULL),
(1445, 10, 104, 0, 326, 'Kleines Kommunion / Konfirmationsbuch, Produkte, Foto & Bilder Torten'),
(1446, 10, 97, 0, 326, '<div class="std">Das Kommunionbuch wird aus einer sehr saftigen Sachermasse  hergestellt. Eingeschlagen wird es mit naturfarbenen Marzipan. Das Kreuz ist auch aus  Marzipan. Das Bild, das Sie uns als JPG schicken k&ouml;nnen wird auf  Esspapier mit Lebensmittelfarbe gedruckt.</div>'),
(1447, 10, 506, 0, 326, '<p>26 x 18 x 5 cm 1200g Netto<br /> F&uuml;r den sch&ouml;nsten Tag im Leben....</p>'),
(1448, 10, 531, 0, 326, NULL),
(1449, 10, 104, 0, 327, 'Kindergeburtstagstorte rund, Produkte, Foto & Bilder Torten'),
(1450, 10, 97, 0, 327, '<div class="std">Zwischen d&uuml;nnen Biskuitlagen kommt abwechselnd eine feine Schoko- und Erdbeercremef&uuml;llung.  &Uuml;berzogen wird die Torte mit rotem Marzipan.  In der Mitte wird  die Torte geschm&uuml;ckt mit einem Hello Kitty Aufleger oder einem Spiderman.</div>'),
(1451, 10, 506, 0, 327, '<p>20 cm &Oslash; 800g<br /> F&uuml;r jeden Hello-Kitty oder Spiderman-Fan<br /> ohne Alkohol</p>'),
(1452, 10, 531, 0, 327, NULL),
(1453, 10, 104, 0, 328, 'Viereckige Geburtstagtorte mit Sacherfüllung - NEU, Produkte, Foto & Bilder Torten'),
(1454, 10, 97, 0, 328, '<div class="std">Der saftige Schokoladenbiskuit wird gef&uuml;llt mit einer Schokoladencreme u. Aprikosenmarmelade.  Die Umrandung der Torte wird mit Nougat eingestrichen und mit Marzipan &uuml;berzogen. Ein wundersch&ouml;nes Rosen-Esspapierdekor  in der Gr&ouml;&szlig;e 24/16 cm runden die Tortenkreation ab. Selbstverst&auml;ndlich k&ouml;nnen Sie auch ein eigens Motiv f&uuml;r die Dekoration nehmen. Diese Torte k&ouml;nnen Sie auch als unsere feine Nusstorte bestellen.</div>'),
(1455, 10, 506, 0, 328, '<p>ca 20/29 cm 2000g Netto<br /> Eine Gaumenfreude f&uuml;r das Geburtstagkind<br /> ohne Alkohol</p>'),
(1456, 10, 531, 0, 328, NULL),
(1457, 10, 104, 0, 329, 'Kindergeburtstagstorte rund - NEU, Produkte, Foto & Bilder Torten'),
(1458, 10, 97, 0, 329, '<div class="std">Zwischen d&uuml;nnen Biskuitlagen kommt abwechselnd eine feine Schoko- und Erdbeercremef&uuml;llung.  &Uuml;berzogen wird die Torte mit braunem Marzipan.  In der Mitte wird  die Torte geschm&uuml;ckt mit einem Winnie Puuh-Esspapier-Aufleger</div>'),
(1459, 10, 506, 0, 329, '<p>20 cm &Oslash; 800g<br /> Endlich Geburtstag<br /> ohne Alkohol</p>'),
(1460, 10, 531, 0, 329, NULL),
(1461, 10, 104, 0, 330, 'Valentinstorte, Produkte, Valentinstag & Muttertag'),
(1462, 10, 97, 0, 330, '<div class="std">Ein ausgefallenes Geschenk f&uuml;r Ihre/n Liebste/n, die Sie auf  eine ganz pers&ouml;nliche Art &uuml;berraschen wollen. Hinter den s&uuml;&szlig;en Gr&uuml;&szlig;en  steckt eine Torte aus saftigem Marzipan-Biskuit, der mit einer  Kirschwassercreme gef&uuml;llt ist und mit wei&szlig;er Schokolade &uuml;berzogen wird.  Der Text kann ver&auml;ndert werden.</div>'),
(1463, 10, 506, 0, 330, '<p>18 x 18&nbsp;cm 1000 g Diese Torte ist immer f&uuml;r eine &Uuml;berraschung angemessen<br />mit Alkohol</p>'),
(1464, 10, 531, 0, 330, NULL),
(1465, 10, 104, 0, 331, 'Muttertagstorte Motiv 2, Produkte, Valentinstag & Muttertag'),
(1466, 10, 97, 0, 331, '<div class="std">Tortentelegramm mit Muttertagsmotiv 2 Ein ausgefallenes Geschenk  f&uuml;r die liebe Mutter, die Sie auf eine ganz pers&ouml;nliche Art &uuml;berraschen  wollen.Hinter den s&uuml;&szlig;en Muttertagsgr&uuml;&szlig;en steckt eine Torte aus saftigem  Marzipan-Biskuit, der mit einer Kirschwassercreme gef&uuml;llt ist und mit  wei&szlig;er Schokolade &uuml;berzogen wird.</div>'),
(1467, 10, 506, 0, 331, '<p>18 x 18&nbsp;cm 1000 g <br />Eine &Uuml;berraschung f&uuml;r die Mama zum Muttertag<br />mit Alkohol</p>'),
(1468, 10, 531, 0, 331, NULL),
(1469, 10, 104, 0, 332, 'Muttertagstorte Motiv 1, Produkte, Valentinstag & Muttertag'),
(1470, 10, 97, 0, 332, '<div class="std">Ein ausgefallenes Geschenk f&uuml;r die liebe Mutter, die Sie auf  eine ganz pers&ouml;nliche Art &uuml;berraschen wollen.Hinter den s&uuml;&szlig;en  Muttertagsgr&uuml;&szlig;e steckt eine Torte aus saftigem Marzipan-Biskuit, der mit  einer Kirschwassercreme gef&uuml;llt ist und mit wei&szlig;er Schokolade &uuml;berzogen  wird. Der Text kann selbstverst&auml;ndlich ge&auml;ndert werden.</div>'),
(1471, 10, 506, 0, 332, '<p>18 x 18&nbsp; cm 1000 g <br />Eine &Uuml;berraschung f&uuml;r die liebe Mama....<br />mit Alkohol</p>'),
(1472, 10, 531, 0, 332, NULL),
(1473, 10, 104, 0, 333, 'Muttertagstorte mit Röschen, Produkte, Valentinstag & Muttertag');
INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1474, 10, 97, 0, 333, '<div class="std">Diese Torte besteht aus einem saftigen Schokoladenbiskuit,  gef&uuml;llt mit einer fein-fruchtigen Erdbeercreme. Eingeschlagen wird diese  Torte mit Marzipan. Ein sch&ouml;nes Muttertagsherz-Embleme bzw. zwei  Marzipanr&ouml;schen runden die Kreation ab.</div>'),
(1475, 10, 506, 0, 333, '<p>28 cm &Oslash; 1400g Netto<br /> Auch eine sch&ouml;ne Variante f&uuml;r den Muttertag<br /> ohne Alkohol</p>'),
(1476, 10, 531, 0, 333, NULL),
(1477, 10, 104, 0, 334, 'Muttertagsherz Neu, Produkte, Valentinstag & Muttertag'),
(1478, 10, 97, 0, 334, '<div class="std">Ein lockerer Biskuit wird mit einer leichten Vanille;- oder  Erdbeercreme 2mal gef&uuml;llt und mit gelben Marzipan eingedeckt. Ein  Muttertagsaufleger und 9 kleine Marzipanherzchen vervollst&auml;ndigen die  Torte.</div>'),
(1479, 10, 506, 0, 334, '<p>1000g Netto<br /> Eine &Uuml;berraschung f&uuml;r die Mutti</p>'),
(1480, 10, 531, 0, 334, NULL),
(1481, 10, 104, 0, 335, 'Weihnachtstelegramm, Produkte, Telegrammtorte'),
(1482, 10, 97, 0, 335, '<div class="std">Zu Weihnachten eine s&uuml;&szlig;e &Uuml;berraschung. Eine Torte aus saftigem  Marzipan-Biskuit, gef&uuml;llt mit Kirschwassercreme und mit wei&szlig;er  Schokolade &uuml;berzogen.</div>'),
(1483, 10, 506, 0, 335, '<p>18 x 18 x 5 cm 1000g Netto<br /> Von drauss vom Walde........<br /> mit Alkohol</p>'),
(1484, 10, 531, 0, 335, NULL),
(1485, 10, 104, 0, 336, 'Strohauer`s Tortentelegramm, Produkte, Telegrammtorte'),
(1486, 10, 97, 0, 336, '<div class="std">Ein ausgefallenes Geschenk f&uuml;r jeden Anlass. Sie k&ouml;nnen Ihren  Text (max. 9 W&ouml;rter) eingeben. Diese Botschaft wird dann von uns auf  Esspapier ausgedruckt. Hinter den s&uuml;&szlig;en Gr&uuml;&szlig;en steckt eine Torte aus  saftigem Marzipan-Biskuit, der mit einer Kirschwassercreme gef&uuml;llt ist  und mit wei&szlig;er Schokolade &uuml;berzogen wird.</div>'),
(1487, 10, 506, 0, 336, '<p>18 x 18&nbsp;cm 1000 g <br />M&ouml;chten Sie jemand &Uuml;berraschen?...<br />mit Alkohol</p>'),
(1488, 10, 531, 0, 336, NULL),
(1489, 10, 104, 0, 337, 'Schoko Baumkuchen 1500 g, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1490, 10, 97, 0, 337, '<p>Diese Baumkuchenspezialit&auml;ten werden wie vor 500 Jahren Schicht f&uuml;r  Schicht &uuml;ber offenem Feuer gebacken. Diese aufwendige Zubereitung  garantiert h&ouml;chste Qualit&auml;t. Nach dem Backen wird der zarte Baumkuchen  mit  Edelzartbitterschokolade &uuml;bergossen.</p>'),
(1491, 10, 506, 0, 337, '<p>H&ouml;he 34 cm 1500g Netto<br /> Diese Baumkuchenspezialit&auml;ten werden wie vor 500 Jahren Schicht f&uuml;r Schicht &uuml;ber offenem Feuer gebacken</p>'),
(1492, 10, 531, 0, 337, NULL),
(1493, 10, 104, 0, 338, 'Orangen Fondant Baumkuchen 1500 g, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1494, 10, 97, 0, 338, '<p>Diese Baumkuchenspezialit&auml;ten werden wie vor 500 Jahren Schicht f&uuml;r  Schicht &uuml;ber offenem Feuer gebacken. Diese aufwendige Zubereitung  garantiert h&ouml;chste Qualit&auml;t. Nach dem Backen wird der zarte Baumkuchen  mit Fondant &uuml;bergossen.</p>'),
(1495, 10, 506, 0, 338, '<p>H&ouml;he 34 cm 1500g Netto<br /> Eine zarte Spezialit&auml;t wie vor 500 Jahren</p>'),
(1496, 10, 531, 0, 338, NULL),
(1497, 10, 104, 0, 339, 'Dreier Paket "Tortenböden", Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1498, 10, 97, 0, 339, '<p>Die richtige Grundlage f&uuml;r frisches, tiefgek&uuml;hltes oder eingemachtes  Obst. Aus feinstem Biskuit mit einem hauchd&uuml;nnen M&uuml;rbteigboden,  eingestrichen mit lockerer Creme, der Rand dicht mit frisch ger&ouml;steten  Mandelbl&auml;ttchen eingeh&uuml;llt. Legen Sie sich diese Tortenb&ouml;den auf Vorrat an- und Sie haben im Nu die  herrlichsten Obsttorten f&uuml;r Ihre Lieben.</p>'),
(1499, 10, 506, 0, 339, '<p>28 cm &Oslash; je 400g Netto<br /> Im handumdrehen einen herrlichen Obstkuchen.</p>'),
(1500, 10, 531, 0, 339, NULL),
(1501, 10, 104, 0, 340, 'Rahm Käsekuchen NEU, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1502, 10, 97, 0, 340, '<p>Aus frischem Odenw&auml;lder Quark, Eiern und frischem Rahm gelingt diese  Spezialit&auml;t so saftig feucht, locker und delikat, wie  zu Omas Zeiten.  Der Boden ist ein zarter, d&uuml;nn ausgerollter Hefem&uuml;rbeteig. Genie&szlig;en Sie den Kuchen leicht erw&auml;rmt und bieten Sie frisch  geschlagene, k&uuml;hle Sahne dazu an.</p>'),
(1503, 10, 506, 0, 340, '<p>26 cm &Oslash; 1850 g Netto<br />Leicht warm genie&szlig;en;- Ein Gaumenschmaus</p>'),
(1504, 10, 531, 0, 340, NULL),
(1505, 10, 104, 0, 341, 'Strohauer`s Nußtorte, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1506, 10, 97, 0, 341, '<p>Saftige, aromatisch gew&uuml;rzte und exquisit gef&uuml;llte Nusstorte mit vielen  frisch gemahlenen Haseln&uuml;ssen. Gef&uuml;llt wird die klassische Nusstorte mit  Kirschlik&ouml;r-Patisseriecreme und &uuml;berzogen mit feiner  Zartbitterschokolade.</p>'),
(1507, 10, 506, 0, 341, '<p>26 cm &Oslash; 1400 g Netto<br />Eine klassische Nu&szlig;torte mit Kirschlik&ouml;r-Patisseriecreme gef&uuml;llt....<br />mit Alkohol</p>'),
(1508, 10, 531, 0, 341, NULL),
(1509, 10, 104, 0, 342, 'Champagner Trüffeltorte, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1510, 10, 97, 0, 342, '<p>Mandel-, Nuss- und Sacherb&ouml;den werden mit Kirschlik&ouml;r getr&auml;nkt und reich  gef&uuml;llt mit prickelnder Champagner-Creme. &Uuml;berzogen wird diese  K&ouml;stlichkeit mit Vollmilchschokolade, dekoriert mit feinen Sp&auml;nen und  Bl&auml;ttchen aus wei&szlig;er Schokolade.</p>'),
(1511, 10, 506, 0, 342, '<p>26 cm &Oslash; 1400 g&nbsp; Mandel-, Nuss- und Sacherb&ouml;den werden mit Kirschlik&ouml;r getr&auml;nkt und reich gef&uuml;llt mit prickelnder Champagner-Creme<br />mit Alkohol</p>'),
(1512, 10, 531, 0, 342, NULL),
(1513, 10, 104, 0, 343, 'Baumkuchen Torte Amaretto Vanilla, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1514, 10, 97, 0, 343, '<p>Feinste Vanillesahne, Amaretto und Eigelbcreme werden zu einer edlen  F&uuml;llung komponiert und mit gehackten, in Amaretto getr&auml;nkten  Baumkuchenst&uuml;cken verfeinert. Zarte, saftige Bisquit-Rouladenst&uuml;ckchen  bilden die Umh&uuml;llung und werden mit herber Schokolade &uuml;berzogen. Zum  Schlu&szlig; wird die Torte mit 12 wei&szlig;en Schokoladenauflegern belegt</p>'),
(1515, 10, 506, 0, 343, '<p>20 cm &Oslash; 1200 g <br />Feinste Vanillesahne, Amaretto und Eigelbcreme werden zu einer edlen F&uuml;llung komponiert.....<br />mit Alkohol</p>'),
(1516, 10, 531, 0, 343, NULL),
(1517, 10, 104, 0, 344, 'Champagner Melba Torte'),
(1518, 10, 97, 0, 344, '<p>Diese Torte wurde dem gro&szlig;en Franzosen und Feinschmecker Anthelm-Brillat  Savarin gewidmet. Frisch p&uuml;rierte, sonnengereifte Pfirsiche, Sahne und  viel Champagner werden von einem zarten Biskuit-Mantel umh&uuml;llt, der mit  feiner Zartbitterschokolade &uuml;berzogen diese edle Kombination ergibt. Wir  empfehlen Ihnen, die Torte halbgefroren als Sorbet zu servieren. So  schmeckt sie besonders prickelnd und erfrischend.</p>'),
(1519, 10, 506, 0, 344, '<p>20 cm &Oslash; 1200 g Netto<br /> Wir empfehlen Ihnen, die Torte halbgefroren als Sorbet zu servieren. So schmeckt sie besonders prickelnd und erfrischend. <br /> mit Alkohol</p>'),
(1520, 10, 531, 0, 344, NULL),
(1521, 10, 104, 0, 345, 'Sommerangebot, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1522, 10, 97, 0, 345, '<p>Viktoria-Torte + Erdbeer-Joghurt-Torte</p>'),
(1523, 10, 506, 0, 345, '<p>20 cm &Oslash; 1200 g + 1200 g<br />Viktoria-Torte + Erdbeer-Joghurt-Torte</p>'),
(1524, 10, 531, 0, 345, NULL),
(1525, 10, 104, 0, 346, 'Heidelberger Erdbeer Joghurt Torte, Kuchen & Torten, Traditionelle Kuchen & Torten'),
(1526, 10, 97, 0, 346, '<p>Eine verf&uuml;hrerische Komposition, die auf der Zunge zergeht. Die leichte  F&uuml;llung aus p&uuml;rierten Erdbeeren, Joghurt und Sahne wird von  Biskuit-Rouladen umh&uuml;llt und mit Erdbeerfruchtgelee &uuml;bergossen.  Der Fruchtgelee&uuml;berzug ist mit Farbstoff E 122 und E 124.   Der Farbstoff kann Aktivit&auml;t u. Aufmerksamkeit bei Kindern  beeintr&auml;chtigen.</p>'),
(1527, 10, 506, 0, 346, '<p>20 cm &Oslash; 1200 g Netto<br /> Eine verf&uuml;hrerische Komposition, die auf der Zunge zergeht<br /> ohne Alkohol</p>'),
(1528, 10, 531, 0, 346, NULL),
(1529, 10, 104, 0, 347, 'Original Strohauer''s Viktoria Torte©'),
(1530, 10, 97, 0, 347, '<p>Orangensaft, frische Sahne, Eigelb, Zitrone, herber Wein und Rum ergeben  diese begl&uuml;ckende Geschmacksf&uuml;lle. Der Boden ist ein d&uuml;nner  Schokoladenbiskuit. Zarte, saftige Biskuit-Rouladen-St&uuml;ckchen sind eine  feine Einlage in der Cremekuppel. Dieselben Rouladen als Umh&uuml;llung, die  mit Orangengelee-&Uuml;berzug abgegl&auml;nzt ist. Unser Tipp: &Uuml;bergie&szlig;en Sie  jedes St&uuml;ck mit Grand Marnier oder flambieren Sie die Torte damit.</p>'),
(1531, 10, 506, 0, 347, '<p>20 cm &Oslash; 1200 g Netto<br />Wie 1963 von Heinrich Strohauer III niedergeschrieben, wird die Strohauer`s Viktoria Torte&copy; noch heute nach dem Original Patentrezept durch unseren Chefkonditor&nbsp;&nbsp; Franz Kreischer hergestellt.</p>'),
(1532, 10, 531, 0, 347, NULL),
(1533, 10, 104, 0, 348, 'Nikolaustorte'),
(1534, 10, 97, 0, 348, '<p>Saftig-feine Schokoladentorte mit zarter Johannisbeerf&uuml;llung, duftenden  Weihnachtsgew&uuml;rzen und Schokoladenst&uuml;ckchen - und als Kr&ouml;nung ein  &Uuml;berzug aus Vollmilch-Kuvert&uuml;re und ein stimmungsvoller  Nikolaus-Aufleger.</p>'),
(1535, 10, 506, 0, 348, '<p>20 cm &Oslash; 800g Netto<br /> F&uuml;r den Nikolausabend genau das Richtige</p>'),
(1536, 10, 531, 0, 348, NULL),
(1537, 10, 104, 0, 349, 'Sachertorte, Kuchen & Torten, Traditionelle Kuchen & Torten, Angebote'),
(1538, 10, 97, 0, 349, '<p>Die Rezeptur dieser Torte brachte Heiner Strohauer nach seiner  Gesellenzeit im Hotel Sacher aus Wien mit! Aus bestem Kakao und edlen  Gew&uuml;rzen ist die saftige, dunkle Sachermasse, aus frischer  Aprikosen-Konfit&uuml;re die s&uuml;&szlig;herbe F&uuml;llung und aus Mandel-Nougatcreme und  Schokolade der feine &Uuml;berzug. All die Zutaten geben dieser Kreation  ihren unnachahmlichen Charakter. Die Torte bleibt lange frisch und  saftig.</p>'),
(1539, 10, 506, 0, 349, '<p>26 cm &Oslash; 1400 g<br />F&uuml;r Schokoladenliebhaber: Eine sehr saftige Schokoladentorte.....<br />ohne Alkohol</p>'),
(1540, 10, 531, 0, 349, NULL),
