(1616, 10, 531, 0, 368, NULL),
(1617, 10, 104, 0, 369, 'Petits- Fours 4 Stck., Produkte, Pralinen & Gebäck'),
(1618, 10, 97, 0, 369, '<div class="std">Sie gelten als "Visitenkarte" einer gepflegten Konditorei. Daher  z&auml;hlen unsere Petits-Fours zu unseren kreativen Glanzpunkten. Zu einem  Glas Champagner oder einfach zwischen durch, sind sie immer ein  kulinarischer und optischer  Genuss. Saftiger spezieller englischer  Biskuit wird mit feinsten Konfit&uuml;ren und verschiedenen aromatischen  Cremes gef&uuml;llt und durch K&uuml;nstlerh&auml;nde ausgarniert. Die Petit-Fours  bestehen aus 4 Geschmacksrichtungen: Whisky; Orangenlik&ouml;r; Kirschwasser  und Weinbrand.</div>'),
(1619, 10, 506, 0, 369, '<p>ca 100g<br />Sie gelten als "Visitenkarte" einer gepflegten Konditorei.<br />mit Alkohol</p>'),
(1620, 10, 531, 0, 369, NULL),
(1621, 10, 104, 0, 370, 'Petits- Fours 12 Stck., Produkte, Pralinen & Gebäck'),
(1622, 10, 97, 0, 370, '<div class="std">Sie gelten als "Visitenkarte" einer gepflegten Konditorei. Daher  z&auml;hlen unsere Petits-Fours zu unseren kreativen Glanzpunkten. Zu einem  Glas Champagner oder einfach zwischen durch, sind sie immer ein  kulinarischer und optischer  Genuss. Saftiger spezieller englischer  Biskuit wird mit feinsten Konfit&uuml;ren und verschiedenen aromatischen  Cremes gef&uuml;llt und durch K&uuml;nstlerh&auml;nde ausgarniert. Die Petit-Fours  bestehen aus 4 Geschmacksrichtungen: Whisky; Orangenlik&ouml;r; Kirschwasser  und Weinbrand.</div>'),
(1623, 10, 506, 0, 370, '<p>ca 300g<br />Sie gelten als "Visitenkarte" einer gepflegten Konditorei.<br />mit Alkohol</p>'),
(1624, 10, 531, 0, 370, NULL),
(1625, 10, 104, 0, 371, 'Petits-Fours 16 Stck., Produkte, Pralinen & Gebäck'),
(1626, 10, 97, 0, 371, '<p>Sie gelten als "Visitenkarte" einer gepflegten Konditorei. F&uuml;r Ihre  Kaffeetafel, als Dessert oder zu einem Glas Champagner, ein  kulinarischer und optischer H&ouml;hepunkt. Saftiger englischer Biskuit wird  mit feinsten Konfit&uuml;ren und verschiedenen Cremes gef&uuml;llt und durch  K&uuml;nstlerh&auml;nde ausgarniert. Die Petits-Fours bestehen aus 4  Geschmacksrichtungen: Whisky; Orangenlik&ouml;r, Kirschwasser und Weinbrand.</p>'),
(1627, 10, 506, 0, 371, '<p>400g Netto<br /> Petits-Fours f&uuml;r Gaumenfreunde<br /> mit Alkohol</p>'),
(1628, 10, 531, 0, 371, NULL),
