(1630, 10, 97, 0, 372, '<div class="std">12&nbsp;Champagner Tr&uuml;ffel sind wirklich eine kleine S&uuml;nde wert. Innen herrlich zart mit dem verf&uuml;hrerischen Prickeln der Champagner-Sahnetr&uuml;ffel-Masse, au&szlig;en umh&uuml;llt mit Vollmilch- und Zartbitter-Schokolade. Gek&uuml;hlt serviert schmecken sie am besten!</div>'),
