(1642, 10, 97, 0, 375, '<p>Eine au&szlig;ergew&ouml;hnliche Geschenkidee... Erlesene Pralinen u. Tr&uuml;ffel in  einer Champagnerflasche. Die Original &bdquo;Champagne de Mailly&ldquo;-Flasche wird  mit einer ausgesuchten Mischung von 25 Tr&uuml;ffel-Pralinen,die in  Gold-Stanniol eingerollt sind, sorgf&auml;ltig gef&uuml;llt. Am Flaschenboden ist  eine &Ouml;ffnung, durch die Sie bequem an die K&ouml;stlichkeiten kommen. Ein  Geschenk mit Genuss!</p>'),
