(250, 9, 'simple', '2013-09-29 16:12:53', NULL, NULL, NULL, 'Rumgetränkter Biskuit, Amarenakirschen, Sultaninen, in Cointreau eingelegte Mandarinen und kandierte Kirschen werden mit einer Kirschwassercreme vermengt. Umhüllt wird diese feine Mischung von einer mit Zartbitterschokolade überzogenen Marzipandecke. Der Boden besteht aus einem lockeren Nussbiskuit.\r\n \r\n', 1, NULL, NULL, NULL, NULL, 0, '/2/0/20037_cassata__1.jpg', 'Cassata', 0, NULL, NULL, NULL, NULL, 'Cassata-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Angebote, Angebote', 'Cassata-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Angebote, Angebote', 'Cassata-Torte', NULL, NULL, NULL, '4', 2, 'Cassata-Torte', NULL, NULL, NULL, 28.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Neu in unserem Versand! \r\nEine Torte für den Rumpunschliebhaber!\r\nØ 26cm', '20037', NULL, '/2/0/20037_cassata__1.jpg', 'Cassata', '2013-09-01 00:00:00', 24.5000, '2013-09-06 00:00:00', 2, '/2/0/20037_cassata__1.jpg', 'Cassata', '2014-10-10 10:34:40', 'cassata-torte', 'cassata-torte.html', 4, 2400.0000, NULL),
(252, 9, 'simple', '2013-10-01 12:39:59', NULL, NULL, NULL, 'Altfranzösischer saftiger Biskuit, wird reichlich getränkt mit Kirschwasser, eingedeckt mit Marzipan und überzogen mit weißer Schokolade. Als Boden dient ein knuspriger Mürbeteig. Frische Pistazien und Belegkirschen runden diese Kreation ab. ', 1, NULL, NULL, NULL, NULL, 0, '/s/i/silvia-torte__1.jpg', 'Königin-Silvia-Torte', 0, NULL, NULL, NULL, NULL, 'Königin-Silvia-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Traditionelle Kuchen & Torten, Traditionelle Kuchen & Torten', 'Königin-Silvia-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Traditionelle Kuchen & Torten, Traditionelle Kuchen & Torten', 'Königin-Silvia-Torte', NULL, NULL, NULL, '4', 2, 'Königin-Silvia-Torte', NULL, NULL, NULL, 27.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Anlässlich zur Hochzeit des Schwedischen Königspaares wurde diese Torte 1976 kreiert und dann dem Paar überreicht. Jetzt haben wir diese königliche Torte wieder im Programm.\r\nGewicht 1600g Ø 26cm', '20025', NULL, '/s/i/silvia-torte__1.jpg', 'Königin-Silvia-Torte', '2013-04-08 00:00:00', 24.5000, '2013-04-30 00:00:00', 2, '/s/i/silvia-torte__1.jpg', 'Königin-Silvia-Torte', '2014-10-08 12:40:38', 'koenigin-silvia-torte', 'koenigin-silvia-torte.html', 4, 2000.0000, NULL),
(253, 9, 'simple', '2013-10-01 12:43:40', NULL, NULL, NULL, '<div class="std">Der Stollen wird aus feinem Butterteig hergestellt, der eine  saftige Marzipanrolle umh&uuml;llt. Nach dem Backen wird er mit einer  Aprikosen-Konfit&uuml;re bestrichen und mit vielen gehackten, frischen  Pistazien bestreut.</div>', 1, NULL, NULL, NULL, NULL, 0, '/p/i/pistazienstollen_1.jpg', 'Pistazien Marzipan Stollen', 0, NULL, NULL, NULL, NULL, 'Pistazien Marzipan Stollen 1000 g, Produkte, Weihnachten', 'Pistazien Marzipan Stollen 1000 g, Produkte, Weihnachten', 'Pistazien Marzipan Stollen 1000 g', NULL, NULL, NULL, '4', 2, 'Pistazien Marzipan Stollen 500 g', NULL, NULL, NULL, 14.7500, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Kenner lieben dieses Naschwerk</p>', '20183', NULL, '/p/i/pistazienstollen_1.jpg', 'Pistazien Marzipan Stollen', NULL, NULL, NULL, 2, '/p/i/pistazienstollen_1.jpg', 'Pistazien Marzipan Stollen', '2013-10-01 12:43:40', 'pistazien-marzipan-stollen-500-g', 'pistazien-marzipan-stollen-500-g.html', 4, 850.0000, NULL),
(254, 9, 'simple', '2013-10-01 12:45:45', NULL, NULL, NULL, '<div class="std">Der zarte Butterteig wird aus vielen gehackten Mandeln hergestellt und mit einer saftigen Marzipanrolle gef&uuml;llt. Nach  dem Backen wird der Stollen gebuttert und mit Vanille- und Puderzucker  best&auml;ubt.</div>', 1, NULL, NULL, NULL, NULL, 0, '/m/a/marzipanstollen_1.jpg', ' Mandel Marzipan Stollen', 0, NULL, NULL, NULL, NULL, 'Marzipan Mandel Stollen 1000g, Produkte, Weihnachten', 'Marzipan Mandel Stollen 1000g, Produkte, Weihnachten', 'Marzipan Mandel Stollen 1000g', NULL, NULL, NULL, '4', 2, ' Mandel Marzipan Stollen   500g', NULL, NULL, NULL, 13.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Eine Alternative zum original Heidelberger Christstollen</p>', '20079', NULL, '/m/a/marzipanstollen_1.jpg', ' Mandel Marzipan Stollen', NULL, NULL, NULL, 2, '/m/a/marzipanstollen_1.jpg', ' Mandel Marzipan Stollen', '2013-10-01 12:45:45', 'mandel-marzipan-stollen-500g', 'mandel-marzipan-stollen-500g.html', 4, 850.0000, NULL),
(255, 9, 'simple', '2013-10-01 12:48:48', NULL, NULL, NULL, '<p>In 180 L&auml;ndern auf allen Kontinenten gilt Strohauer''s Christstollen als  "Botschafter aus Heidelberg" - und das nicht ohne Grund! Erlesene  Zutaten wie die gr&ouml;&szlig;ten, saftigsten, 48 Stunden in Rum geweichten  Sultaninen, Vanille, Mandeln, Orangeat, Zitronat, Rohmarzipan und  exotische Gew&uuml;rze verleihen ihm seine aromatische Saftigkeit. Verpackt in einer weihnachtlichen Tüte.', 1, NULL, NULL, NULL, NULL, 0, '/c/h/christstollen_mit_copyright_2011_1_2.jpg', 'Strohauer''s Original Heidelberger Christstollen', 0, NULL, NULL, NULL, NULL, 'Strohauer`s Original Heidelberger Christstollen 1500 g', 'Strohauer`s Original Heidelberger Christstollen 1500 g', 'Strohauer`s Original Heidelberger Christstollen 1500 g', NULL, NULL, NULL, '4', 2, 'Strohauer''s Original Heidelberger Christstollen © 500 g', NULL, NULL, NULL, 8.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Er darf auf keiner Festtafel fehlen</p>', '20261', NULL, '/c/h/christstollen_mit_copyright_2011_1_2.jpg', 'Strohauer''s Original Heidelberger Christstollen', NULL, NULL, NULL, 2, '/c/h/christstollen_mit_copyright_2011_1_2.jpg', 'Strohauer''s Original Heidelberger Christstollen', '2013-10-01 12:48:48', 'strohauer-s-original-heidelberger-christstollen-c-500-g', 'strohauer-s-original-heidelberger-christstollen-c-500-g.html', 4, 850.0000, NULL),
(256, 9, 'simple', '2013-10-01 12:50:24', NULL, NULL, NULL, 'Marzipan-Mandelstollen 500 gr, eine kl. Flasche (0,2l) Palio Natale Secco, und 6 Weihnachtspralinen mit Alkohol ( können variieren) haben wir in einem schönen Weihnachtspräsentkarton zusammen gestellt.', 1, NULL, NULL, NULL, NULL, 0, '/p/r/pr_sent_advent.jpg', 'Präsent Advent', 0, NULL, NULL, NULL, NULL, 'Präsent Advent, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente', 'Präsent Advent, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente', 'Präsent Advent', NULL, NULL, NULL, '4', 2, 'Präsent Advent', NULL, NULL, NULL, 22.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Für einen gemütlichen Abend daheim', '40013', NULL, '/p/r/pr_sent_advent.jpg', 'Präsent Advent', NULL, NULL, NULL, 2, '/p/r/pr_sent_advent.jpg', 'Präsent Advent', '2013-10-01 12:50:24', 'praesent-advent', 'praesent-advent.html', 4, 1350.0000, NULL),
