(258, 9, 'simple', '2013-10-01 12:55:01', NULL, NULL, NULL, 'Marzipan-Mandelstollen (500 gr), Früchtebrot (500 gr.) eine kl. Flasche (0,2l) Palio Natale Secco, 6 Weihnachtspralinen mit Alkohol in einer Schachtel (können variieren) und ein Ring Baumkuchen (ca. 150 gr) wird in einen wunderschönen Geschenkkarton verpackt.', 1, NULL, NULL, NULL, NULL, 0, '/g/e/gemischte_weihnachtskiste.jpg', 'gemischte Weihnachtskiste', 0, NULL, NULL, NULL, NULL, 'gemischte Weihnachtskiste, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente', 'gemischte Weihnachtskiste, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente', 'gemischte Weihnachtskiste', NULL, NULL, NULL, '4', 2, 'gemischte Weihnachtskiste', NULL, NULL, NULL, 32.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'weihnachtliche Spezialitäten haben wir zu einem schönen Präsent zusammen gestellt.', '40011', NULL, '/g/e/gemischte_weihnachtskiste.jpg', 'gemischte Weihnachtskiste', NULL, NULL, NULL, 2, '/g/e/gemischte_weihnachtskiste.jpg', 'gemischte Weihnachtskiste', '2013-10-01 12:55:01', 'gemischte-weihnachtskiste', 'gemischte-weihnachtskiste.html', 4, 2700.0000, NULL),
(259, 9, 'simple', '2013-10-01 12:56:50', NULL, NULL, NULL, 'Dieser Wein kommt aus der Kellerei Maison Rigal, die seit 1755 der Spezialist für Weine aus dem Südwesten Frankreichs ist.\r\nRebsorte: 100% Gros Manseng \r\nGoldene Farbe. Intensives Bukett, in dem sich Noten von getrockneten Aprikosen und exotischen Früchten mischen. Am Gaumen sehr schön ausgewogen, mit Aromen von kandierten Früchten,Quitten, Feigen und Honig. Durch die feine Säure wirkt der Wein wunderbar erfrischend im Abgang. \r\nAls Aperitif, zu Desserts oder einfach zum Geniesen.\r\nReferenzen: Goldmedaille Concours National des Vins IGP de France 2012 für den 2011er.', 1, NULL, NULL, NULL, NULL, 0, '/d/e/deutsch-franz_sische_freundschaft.jpg', 'Deutsch-Französische Freundschaft', 0, NULL, NULL, NULL, NULL, 'Deutsch-Französische Freundschaft, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente', 'Deutsch-Französische Freundschaft, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente', 'Deutsch-Französische Freundschaft', NULL, NULL, NULL, '4', 2, 'Deutsch-Französische Freundschaft', NULL, NULL, NULL, 26.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Diesen lieblichen Wein haben wir mit einem 500 gr. Mandelmarzipanstollen und edlen Weihnachtspralinen kombiniert und in einen weihnachtlichen Geschenkkarton verpackt.', '40010', NULL, '/d/e/deutsch-franz_sische_freundschaft.jpg', 'Deutsch-Französische Freundschaft', NULL, NULL, NULL, 2, '/d/e/deutsch-franz_sische_freundschaft.jpg', 'Deutsch-Französische Freundschaft', '2013-10-01 12:56:50', 'deutsch-franzoesische-freundschaft', 'deutsch-franzoesische-freundschaft.html', 4, 1700.0000, NULL),
(260, 9, 'simple', '2013-10-01 12:58:27', NULL, NULL, NULL, 'ca. 150 km. südöstlich von Bordeaux kommt dieser köstliche Sauvignon.Das Weingut Maison Rigal ist seit 1755 der Spezialist für Weine aus dem Südwesten Frankreichs.\r\nLeuchtende Farbe mit hellgelben Reflexen. Intensiver, lebhafter Duft mit blumigen Noten. Im Mund kräftig und trocken mit Aromen von Stchelbeere, Passionsfrüchte und Pampelmuse. \r\nIdealer Begleiter von Spargel, Schalen und Krustentieren, Fisch und auch Geflügelgerichten.\r\nDiesen Excellenten Wein haben wir mit unserem Christstollen und feinen Weihnachtspralinen kombiniert.', 1, NULL, NULL, NULL, NULL, 0, '/d/e/deutsch-franz_sische_komposition.jpg', 'Deutsch-französische Komposition', 0, NULL, NULL, NULL, NULL, 'Deutsch-französische Komposition', 'Deutsch-französische Komposition', 'Deutsch-französische Komposition', NULL, NULL, NULL, '4', 2, 'Deutsch-Französische Komposition', NULL, NULL, NULL, 22.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ein excellenter Wein kombiniert mit unserem außergewöhnlichen Heidelberger Christstollen (500 gr.), und 6 Weihnachtspralinen.\r\nSie können uns auch anrufen und aus unserem reichhaltigen Angebot sich selbst ein Präsent zusammenstellen.', '40009', NULL, '/d/e/deutsch-franz_sische_komposition.jpg', 'Deutsch-französische Komposition', NULL, NULL, NULL, 2, '/d/e/deutsch-franz_sische_komposition.jpg', 'Deutsch-französische Komposition', '2013-10-01 12:58:27', 'deutsch-franzoesische-komposition', 'deutsch-franzoesische-komposition.html', 4, 1750.0000, NULL),
