(274, 9, 'simple', '2013-10-01 13:19:02', NULL, NULL, NULL, 'Unsere Linzertorte wird nur mit ausgesuchten Rohstoffen und Gewürzen nach einem alten Rezept, hergestellt. Makronenmasse, Butter,Zucker, Eier,Mandeln,Nüsse,Mehl und Gewürze werden zu einem saftigen Teig verknetet. Gefüllt wird die Torte mit einer feinen Himbeer-Johannisbeer Marmelade. Auch ohne Kühlung lange haltbar!\r\n', 1, NULL, NULL, NULL, NULL, 0, '/l/i/linzertorte.jpg', 'Linzertorte', 0, NULL, NULL, NULL, NULL, '"Wochenendkuchen" Linzertorte NEU, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten', '"Wochenendkuchen" Linzertorte NEU, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten', '"Wochenendkuchen" Linzertorte NEU', NULL, NULL, NULL, '4', 2, '"Wochenendkuchen" Linzertorte NEU ', NULL, NULL, NULL, 23.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ein unvergleichlicher Genuss;- nicht nur zur Winterzeit\r\n 26 cm Ø 1350 g  ', '20019', NULL, '/l/i/linzertorte.jpg', 'Linzertorte', NULL, NULL, NULL, 2, '/l/i/linzertorte.jpg', 'Linzertorte', '2014-10-08 12:44:41', 'wochenendkuchen-linzertorte-neu', 'wochenendkuchen-linzertorte-neu-278.html', 4, 1700.0000, NULL),
(275, 9, 'simple', '2013-10-01 13:21:02', NULL, NULL, NULL, 'Möchten Sie für Ihre Torte einen passenden Bildaufleger? Hier haben Sie die Möglichkeit einen Aufleger zu bestellen. Und so funktioniert es: Laden Sie ein druckfertiges Bild zu uns hoch oder schicken es uns mit der Post. Wir drucken das Bild mit Lebensmittelfarbe für Sie auf Esspapier.', 1, NULL, NULL, NULL, NULL, 0, '/h/e/herz_mit_schmetterling_.jpg', 'Beispiel Ich liebe Dich', 0, NULL, NULL, NULL, NULL, 'Tortenaufleger, Onlineshop, Foto & Bilder Torten', 'Tortenaufleger, Onlineshop, Foto & Bilder Torten', 'Tortenaufleger', NULL, NULL, NULL, '4', 2, 'Tortenaufleger', NULL, NULL, NULL, 10.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Größe: Bildaufleger Ø 20cm ; 18 x 18cm; 20 x 29cm ohne Bearbeitung;- das heißt Sie schicken uns ein fertiges Bild und wir drucken es nur aus.', '20051', NULL, '/h/e/herz_mit_schmetterling_.jpg', 'Beispiel Ich liebe Dich', NULL, NULL, NULL, 2, '/h/e/herz_mit_schmetterling_.jpg', 'Beispiel Ich liebe Dich', '2013-10-01 13:21:02', 'tortenaufleger', 'tortenaufleger.html', 4, 50.0000, NULL),
