(280, 9, 'simple', '2013-10-01 13:57:46', NULL, NULL, NULL, 'Die Handgeschöpfte Schokolade wird nach original Schweizer Rezepturen ganz traditionell von Hand hergestellt. Erlesene Zutaten und sorgfältige Verarbeitung bürgen für ihre excellente Qualität. Ganze Nüsse, karamellisierte Mandeln,Floreniner mit Sahne, oder Fruchtstücke werden mit geschmolzener Schokolade vermischt, anschließend wird die Masse gleichmäßig auf eine Platte gegossen.\r\nIn einer Tüte gemischt je 100g.', 1, NULL, NULL, NULL, NULL, 0, '/h/a/handgesch_pfte_schokolade__1.jpg', 'Handgeschöpfte Schokolade', 0, NULL, NULL, NULL, NULL, 'Handgeschöpfte Schokolade', 'Handgeschöpfte Schokolade', 'Handgeschöpfte Schokolade', NULL, NULL, NULL, '4', 2, 'Handgeschöpfte Schokolade gemischt 300g', NULL, NULL, NULL, 11.4000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Schokoladen-Genuss in höchster Frische', '10013', NULL, '/h/a/handgesch_pfte_schokolade__1.jpg', 'Handgeschöpfte Schokolade', NULL, NULL, NULL, 2, '/h/a/handgesch_pfte_schokolade__1.jpg', 'Handgeschöpfte Schokolade', '2013-10-01 13:57:46', 'handgeschoepfte-schokolade-gemischt-300g', 'handgeschoepfte-schokolade-gemischt-300g.html', 4, 300.0000, NULL),
