(296, 9, 'simple', '2013-10-01 14:19:08', NULL, NULL, NULL, 'Der saftige Sacherboden wird mit Aprikosenmarmelade gefüllt und mit Nougat überzogen. Eingeschlagen wird die Torte mit Marzipan. Das Bild wird mit Lebensmittelfarbe auf Esspapier gedruckt. Sie können die Torte auch als Nussgeschmack bekommen. <p>Saftige, aromatisch gew&uuml;rzte und exquisit gef&uuml;llte Nusstorte mit vielen  frisch gemahlenen Haseln&uuml;ssen. Dünn gef&uuml;llt wird die klassische Nusstorte mit  einer leichten Vanillecreme und Himbeer/Johannisbeermarmelade, überzogen mit feiner Zartbitterschokolade.</p> NICHT VERSANDFÄHIG', 1, NULL, NULL, NULL, NULL, 0, '/k/o/kommunion.jpg', 'Viereckige Geburtstagtorte mit Sacherfüllung', 0, NULL, NULL, NULL, NULL, 'Viereckige Geburtstagtorte mit Sacherfüllung - NEU, Produkte, Foto & Bilder Torten', 'Viereckige Geburtstagtorte mit Sacherfüllung - NEU, Produkte, Foto & Bilder Torten', 'Viereckige Geburtstagtorte mit Sacherfüllung - NEU', NULL, NULL, NULL, '4', 2, 'Kommunion oder Konfirmationstorte ohne Alkohol', NULL, NULL, NULL, 75.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ein toller Blickfang für Ihre Kaffeetafel.', '20084', NULL, '/k/o/kommunion.jpg', 'Viereckige Geburtstagtorte mit Sacherfüllung', NULL, NULL, NULL, 2, '/k/o/kommunion.jpg', 'Viereckige Geburtstagtorte mit Sacherfüllung', '2013-10-01 14:19:08', 'kommunion-oder-konfirmationstorte-ohne-alkohol', 'kommunion-oder-konfirmationstorte-ohne-alkohol.html', 4, 3350.0000, NULL),
