(307, 9, 'simple', '2013-10-01 14:44:09', NULL, NULL, NULL, '<div class="std">Feinster Marzipan mit frisch gemahlenen Mandeln und N&uuml;ssen,  duftender Zimt, werden mit einer aufgeschlagenen Eiwei&szlig;-Glasur einzeln  von Hand ausgestochen. Das sorgsame Backen und die Abstimmung aller  Zutaten nach einem uralten Rezept garantiert die w&uuml;rzige, feucht-saftige  Geschmacksh&uuml;lle dieser traditionellen Weihnachts-Spezialit&auml;t. 500 Gramm  in einer wundersch&ouml;nen Weihnachtsdose.</div>', 1, NULL, NULL, NULL, NULL, 0, '/z/i/zimtsterne_in_schmuckdose_1_1.jpg', 'Zimtsterne', 0, NULL, NULL, NULL, NULL, 'Zimtsterne, Produkte, Weihnachten', 'Zimtsterne, Produkte, Weihnachten', 'Zimtsterne', NULL, NULL, NULL, '4', 2, 'Zimtsterne', NULL, NULL, NULL, 20.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>500g<br /> Eine wundersch&ouml;ne Dose mit leckeren Zimtsternen</p>', '10044', NULL, '/z/i/zimtsterne_in_schmuckdose_1_1.jpg', 'Zimtsterne', NULL, NULL, NULL, 2, '/z/i/zimtsterne_in_schmuckdose_1_1.jpg', 'Zimtsterne', '2014-10-08 09:42:45', 'zimtsterne', 'zimtsterne.html', 4, 900.0000, NULL),
(308, 9, 'simple', '2013-10-01 14:45:23', NULL, NULL, NULL, '<div class="std">Wundervolle weihnachtliche Geb&auml;ckmischung bestehend aus  traditionellen Geb&auml;cksorten wie Zimtsterne, Buttergeb&auml;ck, Anispl&auml;tzchen,  Haselnussmakronen, Baumkuchenspitzen, Vanillekipferl, B&auml;rentatzen und  Zedernhalbmonde.</div>', 1, NULL, NULL, NULL, NULL, 0, '/a/d/adventspaket.jpg', 'Adventspaket', 0, NULL, NULL, NULL, NULL, 'Adventspaket, Produkte, Weihnachten', 'Adventspaket, Produkte, Weihnachten', 'Adventspaket', NULL, NULL, NULL, '4', 2, 'Adventspaket', NULL, NULL, NULL, 26.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>1000 g Netto<br /> Wundervolle weihnachtliche Geb&auml;ckmischung bestehend aus traditionellen Geb&auml;cksorten....</p>', '10489', NULL, '/a/d/adventspaket.jpg', 'Adventspaket', NULL, NULL, NULL, 2, '/a/d/adventspaket.jpg', 'Adventspaket', '2013-10-01 14:45:23', 'adventspaket', 'adventspaket.html', 4, 1350.0000, NULL),
