(310, 9, 'simple', '2013-10-01 14:47:26', NULL, NULL, NULL, '<div class="std">Saftige, dunkle Gew&uuml;rzkuchenmasse erh&auml;lt ihr k&ouml;stliches Aroma  durch die traditionellen weihnachtlichen Gew&uuml;rze, Zimt, besten Kakao,  N&uuml;sse und Mandeln. Gef&uuml;llt mit Aprikosenmarmelade, eingestrichen mit  Nuss-Nougat-Creme und &uuml;berzogen mit Vollmilchschokolade. Dekoriert wird  die Torte mit einem stimmungsvollen Marzipan-Dekoraufleger.</div>', 1, NULL, NULL, NULL, NULL, 0, '/w/e/weihnachtstorte.jpg', 'Strohauer`s Weihnachtstorte', 0, NULL, NULL, NULL, NULL, 'Strohauer`s Weihnachtstorte, Produkte, Weihnachten', 'Strohauer`s Weihnachtstorte, Produkte, Weihnachten', 'Strohauer`s Weihnachtstorte', NULL, NULL, NULL, '4', 2, 'Strohauer`s Weihnachtstorte', NULL, NULL, NULL, 26.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>28 cm &Oslash; 1500 g Netto<br /> Diese weihnachtliche Torte verziehrt jede Festtafel.</p>', '20151', NULL, '/w/e/weihnachtstorte.jpg', 'Strohauer`s Weihnachtstorte', NULL, NULL, NULL, 2, '/w/e/weihnachtstorte.jpg', 'Strohauer`s Weihnachtstorte', '2013-10-01 14:47:26', 'strohauer-s-weihnachtstorte', 'strohauer-s-weihnachtstorte.html', 4, 1850.0000, NULL),
(311, 9, 'simple', '2013-10-01 14:48:45', NULL, NULL, NULL, '<div class="std">Zwischen d&uuml;nnen Biskuit wird abwechselnd eine lockere  Vanillcreme eingef&uuml;llt. Umh&uuml;llt wird sie mit Marzipan und als Dekoration  bieten wir Ihnen verschiedene Weihnachtsaufleger an.</div>', 1, NULL, NULL, NULL, NULL, 0, '/p/1/p1000391.jpg', 'Kleine Weihnachtstorte', 0, NULL, NULL, NULL, NULL, 'Kleine Weihnachtstorte, Produkte, Weihnachten', 'Kleine Weihnachtstorte, Produkte, Weihnachten', 'Kleine Weihnachtstorte', NULL, NULL, NULL, '4', 2, 'Kleine Weihnachtstorte', NULL, NULL, NULL, 23.9000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>20 cm &Oslash; 800 g Netto<br /> Eine sch&ouml;ner Blickfang f&uuml;r die Weihnachtstafel.<br /> ohne Alkohol</p>', '20006', NULL, '/p/1/p1000391.jpg', 'Kleine Weihnachtstorte', NULL, NULL, NULL, 2, '/p/1/p1000391.jpg', 'Kleine Weihnachtstorte', '2013-10-01 14:48:45', 'kleine-weihnachtstorte', 'kleine-weihnachtstorte.html', 4, 1150.0000, NULL),
(312, 9, 'simple', '2013-10-01 14:56:49', NULL, NULL, NULL, '<div class="std">Der zarte Butterteig wird aus vielen gehackten Mandeln hergestellt und mit einer saftigen Marzipanrolle gef&uuml;llt. Nach  dem Backen wird der Stollen gebuttert und mit Vanille- und Puderzucker  best&auml;ubt.</div>', 1, NULL, NULL, NULL, NULL, 0, '/m/a/marzipanstollen.jpg', 'Marzipan Mandel Stollen 1000g', 0, NULL, NULL, NULL, NULL, 'Marzipan Mandel Stollen 1000g, Produkte, Weihnachten', 'Marzipan Mandel Stollen 1000g, Produkte, Weihnachten', 'Marzipan Mandel Stollen 1000g', NULL, NULL, NULL, '4', 2, 'Marzipan Mandel Stollen 1000g', NULL, NULL, NULL, 23.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Eine Alternative zum original Heidelberger Christstollen</p>', '20078', NULL, '/m/a/marzipanstollen.jpg', 'Marzipan Mandel Stollen 1000g', NULL, NULL, NULL, 2, '/m/a/marzipanstollen.jpg', 'Marzipan Mandel Stollen 1000g', '2013-10-01 14:56:49', 'marzipan-mandel-stollen-1000g', 'marzipan-mandel-stollen-1000g.html', 4, 1350.0000, NULL),
