(314, 9, 'simple', '2013-10-01 14:59:36', NULL, NULL, NULL, '<div class="std">In 180 L&auml;ndern auf allen Kontinenten gilt Strohauer''s  Christstollen als "Botschafter aus Heidelberg" - und das nicht ohne  Grund! Erlesene Zutaten wie die gr&ouml;&szlig;ten, saftigsten, 48 Stunden in Rum  geweichten Sultaninen, Vanille, Mandeln, Orangeat, Zitronat, Rohmarzipan  und exotische Gew&uuml;rze verleihen ihm seine aromatische Saftigkeit. Jeder  Christstollen erreicht seinen Empf&auml;nger unbeschadet in einem  wundersch&ouml;nen Geschenkkarton und verleiht "festliche" Stimmung!!</div>', 1, NULL, NULL, NULL, NULL, 0, '/c/h/christstollen_mit_copyright_2011_1_1.jpg', 'Strohauer`s Original Heidelberger Christstollen 1000 g', 0, NULL, NULL, NULL, NULL, 'Strohauer`s Original Heidelberger Christstollen 1000 g, Produkte, Weihnachten', 'Strohauer`s Original Heidelberger Christstollen 1000 g, Produkte, Weihnachten', 'Strohauer`s Original Heidelberger Christstollen 1000 g', NULL, NULL, NULL, '4', 2, 'Strohauer''s Original Heidelberger Christstollen © 1000 g', NULL, NULL, NULL, 15.9000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<div class="std">Er darf auf keiner Festtafel fehlen</div>', '20260', NULL, '/c/h/christstollen_mit_copyright_2011_1_1.jpg', 'Strohauer`s Original Heidelberger Christstollen 1000 g', NULL, NULL, NULL, 2, '/c/h/christstollen_mit_copyright_2011_1_1.jpg', 'Strohauer`s Original Heidelberger Christstollen 1000 g', '2013-10-01 14:59:36', 'strohauer-s-original-heidelberger-christstollen-c-1000-g', 'strohauer-s-original-heidelberger-christstollen-c-1000-g.html', 4, 1350.0000, NULL),
(315, 9, 'simple', '2013-10-01 15:01:46', NULL, NULL, NULL, '<div class="std">Eine erlesene Auswahl hochfeiner Pralinen mit unterschiedlicher  F&uuml;llung. Eine Komposition aus Nougat, Marzipan, Sahne und vieles mehr</div>', 1, NULL, NULL, NULL, NULL, 0, '/p/r/pralinen_hasenpack.jpg', 'Strohauer`s Osterpralinenmischung (ohne Alkohol)', 0, NULL, NULL, NULL, NULL, 'Strohauer`s Osterpralinenmischung (ohne Alkohol), Produkte, Ostern', 'Strohauer`s Osterpralinenmischung (ohne Alkohol), Produkte, Ostern', 'Strohauer`s Osterpralinenmischung (ohne Alkohol)', NULL, NULL, NULL, '4', 2, 'Strohauer`s Osterpralinenmischung (ohne Alkohol)', NULL, NULL, NULL, 14.9000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>ca 250g Netto<br /> Eine erlesene Auswahl hochfeiner Pralinen mit unterschiedlicher F&uuml;llung.  Eine Komposition aus Nougat, Marzipan, Sahne und vieles mehr<br /> ohne Alkohol</p>', '10053', NULL, '/p/r/pralinen_hasenpack.jpg', 'Strohauer`s Osterpralinenmischung (ohne Alkohol)', NULL, NULL, NULL, 2, '/p/r/pralinen_hasenpack.jpg', 'Strohauer`s Osterpralinenmischung (ohne Alkohol)', '2014-10-08 10:41:57', 'strohauer-s-osterpralinenmischung-ohne-alkohol', 'strohauer-s-osterpralinenmischung-ohne-alkohol.html', 4, 600.0000, NULL),
