(318, 9, 'simple', '2013-10-01 15:05:13', NULL, NULL, NULL, '<div class="std">Das Osternest wird Schicht f&uuml;r Schicht aus zartem Baumkuchenteig  am offenem Feuer gebacken und sorgf&auml;ltig mit feinstem Edelfondant  &uuml;berzogen. In der Mitte sitzt ein Osterh&auml;schen aus leckerer  Edelvollmilchschokolade, kleine Tr&uuml;ffel- und Marzipank&ouml;stlichkeiten  liegen zum Verteilen dabei. Das Baumkuchen Osternest ist nicht nur ein  wahrer Augenschmaus f&uuml;r Ihre &ouml;sterliche Kaffeetafel, sondern auch eine  ganz besonders schmackhafte Kuchenspezialit&auml;t.</div>', 1, NULL, NULL, NULL, NULL, 0, '/b/a/baumkuchenosternest_1.jpg', 'Baumkuchen Osternest', 0, NULL, NULL, NULL, NULL, 'Baumkuchen Osternest, Produkte, Ostern', 'Baumkuchen Osternest, Produkte, Ostern', 'Baumkuchen Osternest', NULL, NULL, NULL, '4', 2, 'Baumkuchen Osternest', NULL, NULL, NULL, 27.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>H&ouml;he 11 cm 600g<br /> Ein Augenschmaus f&uuml;r Ihre &ouml;sterliche Kaffeetafel</p>', '20061', NULL, '/b/a/baumkuchenosternest_1.jpg', 'Baumkuchen Osternest', NULL, NULL, NULL, 2, '/b/a/baumkuchenosternest_1.jpg', 'Baumkuchen Osternest', '2013-10-01 15:05:13', 'baumkuchen-osternest', 'baumkuchen-osternest.html', 4, 1250.0000, NULL),
(319, 9, 'simple', '2013-10-01 15:06:34', NULL, NULL, NULL, '<div class="std">&Uuml;berraschen Sie Ihre Familie oder Ihre G&auml;ste mit diesem  originellen Osterlamm. Aus leichtem Butter-Biskuit wird es nach einem  alten &uuml;berlieferten franz&ouml;sischen Rezept aus Butter, Zucker, Eiern und  Mehl gebacken. Mit seinem flaumigen Puderzuckerfell wird es  unwiderstehlich und bildet einen geschmackvollen Mittelpunkt des  traditionellen Osterfestes.</div>', 1, NULL, NULL, NULL, NULL, 0, '/o/s/osterlamm_2.jpg', 'Strohauer`s Osterlamm', 0, NULL, NULL, NULL, NULL, 'Strohauer`s Osterlamm, Produkte, Ostern', 'Strohauer`s Osterlamm, Produkte, Ostern', 'Strohauer`s Osterlamm', NULL, NULL, NULL, '4', 2, 'Strohauer`s Osterlamm', NULL, NULL, NULL, 14.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>500g Netto<br /> Zum Anschneiden fast zu schade</p>', '20062', NULL, '/o/s/osterlamm_2.jpg', 'Strohauer`s Osterlamm', NULL, NULL, NULL, 2, '/o/s/osterlamm_2.jpg', 'Strohauer`s Osterlamm', '2013-10-01 15:06:34', 'strohauer-s-osterlamm', 'strohauer-s-osterlamm.html', 4, 850.0000, NULL),
(320, 9, 'simple', '2013-10-01 15:07:47', NULL, NULL, NULL, '<div class="std">Ein ausgefallenes Geschenk f&uuml;r Ostern. .Hinter den s&uuml;&szlig;en  Ostergr&uuml;&szlig;en steckt eine Torte aus saftigem Marzipan-Biskuit, der mit  einer Kirschwassercreme gef&uuml;llt ist und mit wei&szlig;er Schokolade &uuml;berzogen  wird.</div>', 1, NULL, NULL, NULL, NULL, 0, '/o/s/ostertele_motiv1.jpg', 'Ostertelegramm Motiv 1', 0, NULL, NULL, NULL, NULL, 'Ostertelegramm Motiv 1, Produkte, Ostern', 'Ostertelegramm Motiv 1, Produkte, Ostern', 'Ostertelegramm Motiv 1', NULL, NULL, NULL, '4', 2, 'Ostertelegramm Motiv 1', NULL, NULL, NULL, 27.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>18 x 18 x 5 cm 1000g Netto<br /> Diese Ostertorte wird nicht nur begeistern, sondern auch schmecken.<br /> mit Alkohol</p>', '20125-1', NULL, '/o/s/ostertele_motiv1.jpg', 'Ostertelegramm Motiv 1', NULL, NULL, NULL, 2, '/o/s/ostertele_motiv1.jpg', 'Ostertelegramm Motiv 1', '2013-10-01 15:07:47', 'ostertelegramm-motiv-1', 'ostertelegramm-motiv-1.html', 4, 1350.0000, NULL),
