(334, 9, 'simple', '2013-10-01 15:31:07', NULL, NULL, NULL, '<div class="std">Ein lockerer Biskuit wird mit einer leichten Vanille;- oder  Erdbeercreme 2mal gef&uuml;llt und mit gelben Marzipan eingedeckt. Ein  Muttertagsaufleger und 9 kleine Marzipanherzchen vervollst&auml;ndigen die  Torte.</div>', 1, NULL, NULL, NULL, NULL, 0, '/m/u/muttertagsherz_5__1.jpg', 'Muttertagsherz Neu', 0, NULL, NULL, NULL, NULL, 'Muttertagsherz Neu, Produkte, Valentinstag & Muttertag', 'Muttertagsherz Neu, Produkte, Valentinstag & Muttertag', 'Muttertagsherz Neu', NULL, NULL, NULL, '4', 2, 'Muttertagsherz Neu', NULL, NULL, NULL, 22.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>1000g Netto<br /> Eine &Uuml;berraschung f&uuml;r die Mutti</p>', '20093', NULL, '/m/u/muttertagsherz_5__1.jpg', 'Muttertagsherz Neu', NULL, NULL, NULL, 2, '/m/u/muttertagsherz_5__1.jpg', 'Muttertagsherz Neu', '2013-10-01 15:31:19', 'muttertagsherz-neu', 'muttertagsherz-neu.html', 4, 1350.0000, NULL),
(335, 9, 'simple', '2013-10-01 16:00:07', NULL, NULL, NULL, '<div class="std">Zu Weihnachten eine s&uuml;&szlig;e &Uuml;berraschung. Eine Torte aus saftigem  Marzipan-Biskuit, gef&uuml;llt mit Kirschwassercreme und mit wei&szlig;er  Schokolade &uuml;berzogen.</div>', 1, NULL, NULL, NULL, NULL, 0, '/w/e/weihnachtstelegramm_.jpg', 'Weihnachtstelegramm', 0, NULL, NULL, NULL, NULL, 'Weihnachtstelegramm, Produkte, Telegrammtorte', 'Weihnachtstelegramm, Produkte, Telegrammtorte', 'Weihnachtstelegramm', NULL, NULL, NULL, '4', 2, 'Weihnachtstelegramm', NULL, NULL, NULL, 26.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>18 x 18 x 5 cm 1000g Netto<br /> Von drauss vom Walde........<br /> mit Alkohol</p>', '20129', NULL, '/w/e/weihnachtstelegramm_.jpg', 'Weihnachtstelegramm', '2013-10-01 00:00:00', 24.5000, NULL, 2, '/w/e/weihnachtstelegramm_.jpg', 'Weihnachtstelegramm', '2013-10-01 16:00:07', 'weihnachtstelegramm', 'weihnachtstelegramm.html', 4, 1350.0000, NULL),
(336, 9, 'simple', '2013-10-01 16:01:56', NULL, NULL, NULL, '<div class="std">Ein ausgefallenes Geschenk f&uuml;r jeden Anlass. Sie k&ouml;nnen Ihren  Text (max. 9 W&ouml;rter) eingeben. Diese Botschaft wird dann von uns auf  Esspapier ausgedruckt. Hinter den s&uuml;&szlig;en Gr&uuml;&szlig;en steckt eine Torte aus  saftigem Marzipan-Biskuit, der mit einer Kirschwassercreme gef&uuml;llt ist  und mit wei&szlig;er Schokolade &uuml;berzogen wird.</div>', 1, NULL, NULL, NULL, NULL, 0, '/t/e/telegrammtorte.jpg', 'Strohauer`s Tortentelegramm', 0, NULL, NULL, NULL, NULL, 'Strohauer`s Tortentelegramm, Produkte, Telegrammtorte', 'Strohauer`s Tortentelegramm, Produkte, Telegrammtorte', 'Strohauer`s Tortentelegramm', NULL, NULL, NULL, '4', 2, 'Strohauer`s Telegrammtorte ©', NULL, NULL, NULL, 27.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>18 x 18&nbsp;cm 1000 g <br />M&ouml;chten Sie jemand &Uuml;berraschen?...<br />mit Alkohol</p>', '20126', NULL, '/t/e/telegrammtorte.jpg', 'Strohauer`s Tortentelegramm', NULL, NULL, NULL, 2, '/t/e/telegrammtorte.jpg', 'Strohauer`s Tortentelegramm', '2013-10-01 16:01:56', 'strohauer-s-telegrammtorte-c', 'strohauer-s-telegrammtorte-c.html', 4, 1350.0000, NULL),
(337, 9, 'simple', '2013-10-01 16:05:01', NULL, NULL, NULL, '<p>Diese Baumkuchenspezialit&auml;ten werden wie vor 500 Jahren Schicht f&uuml;r  Schicht &uuml;ber offenem Feuer gebacken. Diese aufwendige Zubereitung  garantiert h&ouml;chste Qualit&auml;t. Nach dem Backen wird der zarte Baumkuchen  mit  Edelzartbitterschokolade &uuml;bergossen.</p>', 1, NULL, NULL, NULL, NULL, 0, '/b/a/baumkuchen_dunkel_1.jpg', 'Schoko Baumkuchen 1500 g', 0, NULL, NULL, NULL, NULL, 'Schoko Baumkuchen 1500 g, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Schoko Baumkuchen 1500 g, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Schoko Baumkuchen 1500 g', NULL, NULL, NULL, '4', 2, 'Schoko Baumkuchen 1500 g', NULL, NULL, NULL, 39.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>H&ouml;he 34 cm 1500g Netto<br /> Diese Baumkuchenspezialit&auml;ten werden wie vor 500 Jahren Schicht f&uuml;r Schicht &uuml;ber offenem Feuer gebacken</p>', '20049', NULL, '/b/a/baumkuchen_dunkel_1.jpg', 'Schoko Baumkuchen 1500 g', NULL, NULL, NULL, 2, '/b/a/baumkuchen_dunkel_1.jpg', 'Schoko Baumkuchen 1500 g', '2013-10-01 16:05:01', 'schoko-baumkuchen-1500-g', 'schoko-baumkuchen-1500-g.html', 4, 1850.0000, NULL),
(338, 9, 'simple', '2013-10-01 16:07:50', NULL, NULL, NULL, '<p>Diese Baumkuchenspezialit&auml;ten werden wie vor 500 Jahren Schicht f&uuml;r  Schicht &uuml;ber offenem Feuer gebacken. Diese aufwendige Zubereitung  garantiert h&ouml;chste Qualit&auml;t. Nach dem Backen wird der zarte Baumkuchen  mit Fondant &uuml;bergossen.</p>', 1, NULL, NULL, NULL, NULL, 1, '/b/a/baumkuchen_hell_1.jpg', 'Orangen Fondant Baumkuchen 1500 g', 0, NULL, NULL, NULL, NULL, 'Orangen Fondant Baumkuchen 1500 g, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Orangen Fondant Baumkuchen 1500 g, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Orangen Fondant Baumkuchen 1500 g', NULL, NULL, NULL, '4', 2, 'Orangen Fondant Baumkuchen 1500 g', NULL, NULL, NULL, 39.0000, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>H&ouml;he 34 cm 1500g Netto<br /> Eine zarte Spezialit&auml;t wie vor 500 Jahren</p>', '20016', NULL, '/b/a/baumkuchen_hell_1.jpg', 'Orangen Fondant Baumkuchen 1500 g', NULL, NULL, NULL, 2, '/b/a/baumkuchen_hell_1.jpg', 'Orangen Fondant Baumkuchen 1500 g', '2014-10-08 12:26:50', 'orangen-fondant-baumkuchen-1500-g', 'orangen-fondant-baumkuchen-1500-g.html', 4, 1850.0000, NULL),
(339, 9, 'simple', '2013-10-01 16:11:26', NULL, NULL, NULL, '<p>Die richtige Grundlage f&uuml;r frisches, tiefgek&uuml;hltes oder eingemachtes  Obst. Aus feinstem Biskuit mit einem hauchd&uuml;nnen M&uuml;rbteigboden,  eingestrichen mit lockerer Creme, der Rand dicht mit frisch ger&ouml;steten  Mandelbl&auml;ttchen eingeh&uuml;llt. Legen Sie sich diese Tortenb&ouml;den auf Vorrat an- und Sie haben im Nu die  herrlichsten Obsttorten f&uuml;r Ihre Lieben.</p>', 1, NULL, NULL, NULL, NULL, 0, '/d/r/drei_tortenb_den_20107.jpg', 'Dreier Paket "Tortenböden"', 0, NULL, NULL, NULL, NULL, 'Dreier Paket "Tortenböden", Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Dreier Paket "Tortenböden", Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Dreier Paket "Tortenböden"', NULL, NULL, NULL, '4', 2, 'Dreier Paket "Tortenböden"', NULL, NULL, NULL, 18.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>28 cm &Oslash; je 400g Netto<br /> Im handumdrehen einen herrlichen Obstkuchen.</p>', '20107', NULL, '/d/r/drei_tortenb_den_20107.jpg', 'Dreier Paket "Tortenböden"', NULL, NULL, NULL, 2, '/d/r/drei_tortenb_den_20107.jpg', 'Dreier Paket "Tortenböden"', '2013-10-01 16:11:26', 'dreier-paket-tortenboeden', 'dreier-paket-tortenboeden.html', 4, 1550.0000, NULL),
(340, 9, 'simple', '2013-10-01 16:13:03', NULL, NULL, NULL, '<p>Aus frischem Odenw&auml;lder Quark, Eiern und frischem Rahm gelingt diese  Spezialit&auml;t so saftig feucht, locker und delikat, wie  zu Omas Zeiten.  Der Boden ist ein zarter, d&uuml;nn ausgerollter Hefem&uuml;rbeteig. Genie&szlig;en Sie den Kuchen leicht erw&auml;rmt und bieten Sie frisch  geschlagene, k&uuml;hle Sahne dazu an.</p>', 1, NULL, NULL, NULL, NULL, 0, '/r/a/rahm-k_se-kuchen_1__1.jpg', 'Rahm Käsekuchen', 0, NULL, NULL, NULL, NULL, 'Rahm Käsekuchen NEU, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Rahm Käsekuchen NEU, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Rahm Käsekuchen NEU', NULL, NULL, NULL, '4', 2, 'Rahm Käsekuchen NEU', NULL, NULL, NULL, 23.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>26 cm &Oslash; 1850 g Netto<br />Leicht warm genie&szlig;en;- Ein Gaumenschmaus</p>', '20014', NULL, '/r/a/rahm-k_se-kuchen_1__1.jpg', 'Rahm Käsekuchen', '2013-10-01 00:00:00', 20.0000, NULL, 2, '/r/a/rahm-k_se-kuchen_1__1.jpg', 'Rahm Käsekuchen', '2014-10-08 12:44:03', 'rahm-kaesekuchen-neu', 'rahm-kaesekuchen-neu.html', 4, 2200.0000, NULL),
(341, 9, 'simple', '2013-10-01 16:14:20', NULL, NULL, NULL, '<p>Saftige, aromatisch gew&uuml;rzte und exquisit gef&uuml;llte Nusstorte mit vielen  frisch gemahlenen Haseln&uuml;ssen. Gef&uuml;llt wird die klassische Nusstorte mit  Kirschlik&ouml;r-Patisseriecreme und &uuml;berzogen mit feiner  Zartbitterschokolade.</p>', 1, NULL, NULL, NULL, NULL, 0, '/n/u/nusstorte_1_.jpg', 'Strohauer`s Nußtorte', 0, NULL, NULL, NULL, NULL, 'Strohauer`s Nußtorte, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Strohauer`s Nußtorte, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Strohauer`s Nußtorte', NULL, NULL, NULL, '4', 2, 'Strohauer`s Nußtorte', NULL, NULL, NULL, 25.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>26 cm &Oslash; 1400 g Netto<br />Eine klassische Nu&szlig;torte mit Kirschlik&ouml;r-Patisseriecreme gef&uuml;llt....<br />mit Alkohol</p>', '20010', NULL, '/n/u/nusstorte_1_.jpg', 'Strohauer`s Nußtorte', NULL, NULL, NULL, 2, '/n/u/nusstorte_1_.jpg', 'Strohauer`s Nußtorte', '2014-10-08 12:14:34', 'strohauer-s-nusstorte', 'strohauer-s-nusstorte.html', 4, 1750.0000, NULL),
(342, 9, 'simple', '2013-10-01 16:15:34', NULL, NULL, NULL, '<p>Mandel-, Nuss- und Sacherb&ouml;den werden mit Kirschlik&ouml;r getr&auml;nkt und reich  gef&uuml;llt mit prickelnder Champagner-Creme. &Uuml;berzogen wird diese  K&ouml;stlichkeit mit Vollmilchschokolade, dekoriert mit feinen Sp&auml;nen und  Bl&auml;ttchen aus wei&szlig;er Schokolade.</p>', 1, NULL, NULL, NULL, NULL, 0, '/c/h/champagner_trueffeltorte.jpg', 'Champagner Trüffeltorte', 0, NULL, NULL, NULL, NULL, 'Champagner Trüffeltorte, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Champagner Trüffeltorte, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Champagner Trüffeltorte', NULL, NULL, NULL, '4', 2, 'Champagner Trüffeltorte ', NULL, NULL, NULL, 27.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>26 cm &Oslash; 1400 g&nbsp; Mandel-, Nuss- und Sacherb&ouml;den werden mit Kirschlik&ouml;r getr&auml;nkt und reich gef&uuml;llt mit prickelnder Champagner-Creme<br />mit Alkohol</p>', '20070', NULL, '/c/h/champagner_trueffeltorte.jpg', 'Champagner Trüffeltorte', NULL, NULL, NULL, 2, '/c/h/champagner_trueffeltorte.jpg', 'Champagner Trüffeltorte', '2013-10-01 16:15:34', 'champagner-trueffeltorte', 'champagner-trueffeltorte.html', 4, 1750.0000, NULL),
(343, 9, 'simple', '2013-10-01 16:17:24', NULL, NULL, NULL, '<p>Feinste Vanillesahne, Amaretto und Eigelbcreme werden zu einer edlen  F&uuml;llung komponiert und mit gehackten, in Amaretto getr&auml;nkten  Baumkuchenst&uuml;cken verfeinert. Zarte, saftige Bisquit-Rouladenst&uuml;ckchen  bilden die Umh&uuml;llung und werden mit herber Schokolade &uuml;berzogen. Zum  Schlu&szlig; wird die Torte mit 12 wei&szlig;en Schokoladenauflegern belegt</p>', 1, NULL, NULL, NULL, NULL, 0, '/b/a/baumkuchentorte_1_.jpg', 'Baumkuchen Torte Amaretto Vanilla', 0, NULL, NULL, NULL, NULL, 'Baumkuchen Torte Amaretto Vanilla, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Baumkuchen Torte Amaretto Vanilla, Produkte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Baumkuchen Torte Amaretto Vanilla', NULL, NULL, NULL, '4', 2, 'Baumkuchen Torte Amaretto Vanilla', NULL, NULL, NULL, 26.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>20 cm &Oslash; 1200 g <br />Feinste Vanillesahne, Amaretto und Eigelbcreme werden zu einer edlen F&uuml;llung komponiert.....<br />mit Alkohol</p>', '20409', NULL, '/b/a/baumkuchentorte_1_.jpg', 'Baumkuchen Torte Amaretto Vanilla', NULL, NULL, NULL, 2, '/b/a/baumkuchentorte_1_.jpg', 'Baumkuchen Torte Amaretto Vanilla', '2013-10-01 16:17:24', 'baumkuchen-torte-amaretto-vanilla', 'baumkuchen-torte-amaretto-vanilla.html', 4, 1550.0000, NULL),
(344, 9, 'simple', '2013-10-01 16:19:27', NULL, NULL, NULL, '<p>Diese Torte wurde dem gro&szlig;en Franzosen und Feinschmecker Anthelm-Brillat  Savarin gewidmet. Frisch p&uuml;rierte, sonnengereifte Pfirsiche, Sahne und  viel Champagner werden von einem zarten Biskuit-Mantel umh&uuml;llt, der mit  feiner Zartbitterschokolade &uuml;berzogen diese edle Kombination ergibt. Wir  empfehlen Ihnen, die Torte halbgefroren als Sorbet zu servieren. So  schmeckt sie besonders prickelnd und erfrischend.</p>', 1, NULL, NULL, NULL, NULL, 0, '/c/h/champagnermelba.jpg', 'Champagner Melba Torte', 0, NULL, NULL, NULL, NULL, 'Champagner Melba Torte', 'Champagner Melba Torte', 'Champagner Melba Torte', NULL, NULL, NULL, '4', 2, 'Champagner Melba Torte', NULL, NULL, NULL, 28.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>20 cm &Oslash; 1200 g Netto<br /> Wir empfehlen Ihnen, die Torte halbgefroren als Sorbet zu servieren. So schmeckt sie besonders prickelnd und erfrischend. <br /> mit Alkohol</p>', '20005', NULL, '/c/h/champagnermelba.jpg', 'Champagner Melba Torte', NULL, NULL, NULL, 2, '/c/h/champagnermelba.jpg', 'Champagner Melba Torte', '2014-10-08 12:04:46', 'champagner-melba-torte', 'champagner-melba-torte.html', 4, 1550.0000, NULL),
(345, 9, 'simple', '2013-10-01 16:20:46', NULL, NULL, NULL, '<p>Viktoria-Torte + Erdbeer-Joghurt-Torte</p>', 1, NULL, NULL, NULL, NULL, 0, '/2/0/20200_1.jpg', 'Viktoria- u. Erdbeerjoghurt-Torte', 0, NULL, NULL, NULL, NULL, 'Sommerangebot, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Sommerangebot, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Sommerangebot', NULL, NULL, NULL, '4', 2, 'Viktoria- u. Erdbeerjoghurt-Torte', NULL, NULL, NULL, 52.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>20 cm &Oslash; 1200 g + 1200 g<br />Viktoria-Torte + Erdbeer-Joghurt-Torte</p>', '20200', NULL, '/2/0/20200_1.jpg', 'Viktoria- u. Erdbeerjoghurt-Torte', NULL, NULL, NULL, 2, '/2/0/20200_1.jpg', 'Viktoria- u. Erdbeerjoghurt-Torte', '2013-10-01 16:20:46', 'viktoria-u-erdbeerjoghurt-torte', 'viktoria-u-erdbeerjoghurt-torte.html', 4, 2750.0000, NULL),
(346, 9, 'simple', '2013-10-01 16:22:03', NULL, NULL, NULL, '<p>Eine verf&uuml;hrerische Komposition, die auf der Zunge zergeht. Die leichte  F&uuml;llung aus p&uuml;rierten Erdbeeren, Joghurt und Sahne wird von  Biskuit-Rouladen umh&uuml;llt und mit Erdbeerfruchtgelee &uuml;bergossen.  Der Fruchtgelee&uuml;berzug ist mit Farbstoff E 122 und E 124.   Der Farbstoff kann Aktivit&auml;t u. Aufmerksamkeit bei Kindern  beeintr&auml;chtigen.</p>', 1, NULL, NULL, NULL, NULL, 0, '/e/r/erdbeerjoghurt.jpg', 'Heidelberger Erdbeer Joghurt Torte', 0, NULL, NULL, NULL, NULL, 'Heidelberger Erdbeer Joghurt Torte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Heidelberger Erdbeer Joghurt Torte, Kuchen & Torten, Traditionelle Kuchen & Torten', 'Heidelberger Erdbeer Joghurt Torte', NULL, NULL, NULL, '4', 2, 'Heidelberger Erdbeer Joghurt Torte', NULL, NULL, NULL, 26.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>20 cm &Oslash; 1200 g Netto<br /> Eine verf&uuml;hrerische Komposition, die auf der Zunge zergeht<br /> ohne Alkohol</p>', '20011', NULL, '/e/r/erdbeerjoghurt.jpg', 'Heidelberger Erdbeer Joghurt Torte', NULL, NULL, NULL, 2, '/e/r/erdbeerjoghurt.jpg', 'Heidelberger Erdbeer Joghurt Torte', '2014-10-08 12:16:41', 'heidelberger-erdbeer-joghurt-torte', 'heidelberger-erdbeer-joghurt-torte.html', 4, 1550.0000, NULL),
(347, 9, 'simple', '2013-10-01 16:23:21', NULL, NULL, NULL, '<p>Orangensaft, frische Sahne, Eigelb, Zitrone, herber Wein und Rum ergeben  diese begl&uuml;ckende Geschmacksf&uuml;lle. Der Boden ist ein d&uuml;nner  Schokoladenbiskuit. Zarte, saftige Biskuit-Rouladen-St&uuml;ckchen sind eine  feine Einlage in der Cremekuppel. Dieselben Rouladen als Umh&uuml;llung, die  mit Orangengelee-&Uuml;berzug abgegl&auml;nzt ist. Unser Tipp: &Uuml;bergie&szlig;en Sie  jedes St&uuml;ck mit Grand Marnier oder flambieren Sie die Torte damit.</p>', 1, NULL, NULL, NULL, NULL, 0, '/v/i/viktoriatorte.jpg', 'Original Strohauer''s Viktoria Torte©', 0, NULL, NULL, NULL, NULL, 'Original Strohauer''s Viktoria Torte©', 'Original Strohauer''s Viktoria Torte©', 'Original Strohauer''s Viktoria Torte©', NULL, NULL, NULL, '4', 2, 'Strohauer''s Viktoria Torte©', NULL, NULL, NULL, 26.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>20 cm &Oslash; 1200 g Netto<br />Wie 1963 von Heinrich Strohauer III niedergeschrieben, wird die Strohauer`s Viktoria Torte&copy; noch heute nach dem Original Patentrezept durch unseren Chefkonditor&nbsp;&nbsp; Franz Kreischer hergestellt.</p>', '20001', NULL, '/v/i/viktoriatorte.jpg', 'Original Strohauer''s Viktoria Torte©', NULL, NULL, NULL, 2, '/v/i/viktoriatorte.jpg', 'Original Strohauer''s Viktoria Torte©', '2014-10-08 11:58:19', 'strohauer-s-viktoria-tortec', 'strohauer-s-viktoria-tortec-352.html', 4, 1550.0000, NULL),
(348, 9, 'simple', '2013-10-01 16:24:35', NULL, NULL, NULL, '<p>Saftig-feine Schokoladentorte mit zarter Johannisbeerf&uuml;llung, duftenden  Weihnachtsgew&uuml;rzen und Schokoladenst&uuml;ckchen - und als Kr&ouml;nung ein  &Uuml;berzug aus Vollmilch-Kuvert&uuml;re und ein stimmungsvoller  Nikolaus-Aufleger.</p>', 1, NULL, NULL, NULL, NULL, 0, '/n/i/nikolaustorte.jpg', 'Nikolaustorte', 0, NULL, NULL, NULL, NULL, 'Nikolaustorte', 'Nikolaustorte', 'Nikolaustorte', NULL, NULL, NULL, '4', 2, 'Nikolaustorte', NULL, NULL, NULL, 22.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>20 cm &Oslash; 800g Netto<br /> F&uuml;r den Nikolausabend genau das Richtige</p>', '20160', NULL, '/n/i/nikolaustorte.jpg', 'Nikolaustorte', NULL, NULL, NULL, 2, '/n/i/nikolaustorte.jpg', 'Nikolaustorte', '2013-10-01 16:24:35', 'nikolaustorte', 'nikolaustorte.html', 4, 1150.0000, NULL),
(349, 9, 'simple', '2013-10-01 16:26:10', NULL, NULL, NULL, '<p>Die Rezeptur dieser Torte brachte Heiner Strohauer nach seiner  Gesellenzeit im Hotel Sacher aus Wien mit! Aus bestem Kakao und edlen  Gew&uuml;rzen ist die saftige, dunkle Sachermasse, aus frischer  Aprikosen-Konfit&uuml;re die s&uuml;&szlig;herbe F&uuml;llung und aus Mandel-Nougatcreme und  Schokolade der feine &Uuml;berzug. All die Zutaten geben dieser Kreation  ihren unnachahmlichen Charakter. Die Torte bleibt lange frisch und  saftig.</p>', 1, NULL, NULL, NULL, NULL, 0, '/s/a/sachertorte_1_.jpg', 'Sachertorte', 0, NULL, NULL, NULL, NULL, 'Sachertorte, Kuchen & Torten, Traditionelle Kuchen & Torten, Angebote', 'Sachertorte, Kuchen & Torten, Traditionelle Kuchen & Torten, Angebote', 'Sachertorte', NULL, NULL, NULL, '4', 2, 'Sachertorte', NULL, NULL, NULL, 25.0000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>26 cm &Oslash; 1400 g<br />F&uuml;r Schokoladenliebhaber: Eine sehr saftige Schokoladentorte.....<br />ohne Alkohol</p>', '20092', NULL, '/s/a/sachertorte_1_.jpg', 'Sachertorte', NULL, NULL, NULL, 2, '/s/a/sachertorte_1_.jpg', 'Sachertorte', '2014-09-26 17:34:10', 'sachertorte', 'sachertorte.html', 4, 1750.0000, NULL),
