(351, 9, 'simple', '2014-10-08 08:22:06', NULL, NULL, NULL, '<p>Auch sie werden Schicht f&uuml;r Schicht am offenen Feuer zart gebacken, in  St&uuml;cke geschnitten, mit feiner Zartbitterschokolade und  Vollmilchschokolade &uuml;bergossen</p>', 1, NULL, NULL, NULL, NULL, 0, '/b/a/baumkuchen_spitzen_1.jpg', NULL, 0, NULL, NULL, NULL, NULL, 'Baumkuchenspitzen, Produkte, Pralinen & Gebäck', 'Baumkuchenspitzen, Produkte, Pralinen & Gebäck', 'Baumkuchenspitzen', NULL, NULL, NULL, '4', 2, 'Baumkuchenspitzen', NULL, NULL, NULL, 23.5000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>600 g Netto<br /> Eine zarte Verf&uuml;hrung<br /> ohne Alkohol</p>', '10018', NULL, '/b/a/baumkuchen_spitzen_1.jpg', NULL, NULL, NULL, NULL, 2, '/b/a/baumkuchen_spitzen_1.jpg', NULL, '2014-10-08 08:22:06', 'baumkuchenspitzen', 'baumkuchenspitzen.html', 4, 1000.0000, NULL),
