(369, 9, 'simple', '2014-10-08 11:04:45', NULL, NULL, NULL, '<div class="std">Sie gelten als "Visitenkarte" einer gepflegten Konditorei. Daher  z&auml;hlen unsere Petits-Fours zu unseren kreativen Glanzpunkten. Zu einem  Glas Champagner oder einfach zwischen durch, sind sie immer ein  kulinarischer und optischer  Genuss. Saftiger spezieller englischer  Biskuit wird mit feinsten Konfit&uuml;ren und verschiedenen aromatischen  Cremes gef&uuml;llt und durch K&uuml;nstlerh&auml;nde ausgarniert. Die Petit-Fours  bestehen aus 4 Geschmacksrichtungen: Whisky; Orangenlik&ouml;r; Kirschwasser  und Weinbrand.</div>', 1, NULL, NULL, NULL, NULL, 0, '/1/0/10066-1_petit_fours-4.jpg', NULL, 0, NULL, NULL, NULL, NULL, 'Petits- Fours 4 Stck., Produkte, Pralinen & Gebäck', 'Petits- Fours 4 Stck., Produkte, Pralinen & Gebäck', 'Petits- Fours 4 Stck.', NULL, NULL, NULL, '4', 2, 'Petits- Fours 4 Stck.', NULL, NULL, NULL, 5.9000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>ca 100g<br />Sie gelten als "Visitenkarte" einer gepflegten Konditorei.<br />mit Alkohol</p>', '10065-4', NULL, '/1/0/10066-1_petit_fours-4.jpg', NULL, NULL, NULL, NULL, 2, '/1/0/10066-1_petit_fours-4.jpg', NULL, '2014-10-08 11:04:45', 'petits-fours-4-stck', 'petits-fours-4-stck.html', 4, 350.0000, NULL),
