(375, 9, 'simple', '2014-10-08 11:30:31', NULL, NULL, NULL, '<p>Eine au&szlig;ergew&ouml;hnliche Geschenkidee... Erlesene Pralinen u. Tr&uuml;ffel in  einer Champagnerflasche. Die Original &bdquo;Champagne de Mailly&ldquo;-Flasche wird  mit einer ausgesuchten Mischung von 25 Tr&uuml;ffel-Pralinen,die in  Gold-Stanniol eingerollt sind, sorgf&auml;ltig gef&uuml;llt. Am Flaschenboden ist  eine &Ouml;ffnung, durch die Sie bequem an die K&ouml;stlichkeiten kommen. Ein  Geschenk mit Genuss!</p>', 1, NULL, NULL, NULL, NULL, 0, '/t/r/trueffelflasche.jpg', NULL, 0, NULL, NULL, NULL, NULL, 'Champagnertrüffelflasche gefüllt mit Pralinen u. Trüffeln, Produkte, Pralinen & Gebäck', 'Champagnertrüffelflasche gefüllt mit Pralinen u. Trüffeln, Produkte, Pralinen & Gebäck', 'Champagnertrüffelflasche gefüllt mit Pralinen u. Trüffeln', NULL, NULL, NULL, '4', 2, 'Champagnertrüffel Flasche gefüllt mit Pralinen u. Trüffeln', NULL, NULL, NULL, 24.9000, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>320 g Netto<br /> Eine Champagnerflasche, die es in sich hat...<br /> mit Alkohol</p>', '10072', NULL, '/t/r/trueffelflasche.jpg', NULL, NULL, NULL, NULL, 2, '/t/r/trueffelflasche.jpg', NULL, '2014-10-08 11:30:31', 'champagnertruffelflasche-gefullt-mit-pralinen-u-truffeln', 'champagnertruffelflasche-gefullt-mit-pralinen-u-truffeln.html', 4, 1520.0000, NULL),
