(143, 1, '512dimm|Enabled|Crucial|Crucial 512MB PC4200 DDR2 533MHz Memory||Crucial 512MB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|Crucial 512MB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|99.99|1', 40),
(143, 3, '512dimm|Enabled|Crucial|Crucial 512MB PC4200 DDR2 533MHz Memory||Crucial 512MB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|Crucial 512MB PC4200 DDR2 533MHz Memory Crucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer. Every single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality.|99.99|1', 101),
(373, 2, '10071-25|Aktiviert|Champagner Trüffel|335|685||Champagner Trüffel, Produkte, Pralinen & Gebäck|25&nbsp;Champagner Tr&uuml;ffel sind wirklich eine kleine S&uuml;nde wert. Innen herrlich zart mit dem verf&uuml;hrerischen Prickeln der Champagner-Sahnetr&uuml;ffel-Masse, au&szlig;en umh&uuml;llt mit Vollmilch- und Zartbitter-Schokolade. Gek&uuml;hlt serviert schmecken sie am besten!|ca.&nbsp;335 g St&uuml;ck f&uuml;r St&uuml;ck eine Verf&uuml;hrungmit Alkohol|17.25|1', 774),
(374, 2, '10071-36|Aktiviert|Champagner Trüffel|480|830||Champagner Trüffel, Produkte, Pralinen & Gebäck|36 Champagner Tr&uuml;ffel sind wirklich eine kleine S&uuml;nde wert. Innen herrlich zart mit dem verf&uuml;hrerischen Prickeln der Champagner-Sahnetr&uuml;ffel-Masse, au&szlig;en umh&uuml;llt mit Vollmilch- und Zartbitter-Schokolade. Gek&uuml;hlt serviert schmecken sie am besten!|ca. 480 g St&uuml;ck f&uuml;r St&uuml;ck eine Verf&uuml;hrungmit Alkohol|23.9|1', 775),
(377, 2, '10073-25|Aktiviert|Gemischte Trüffel|325|675||Gemischte Trüffel, Onlineshop, Onlineshop, Pralinen & Gebäck, Pralinen & Gebäck, Weihnachten, Weihnachten|Ein wahrer Genuss.25 Gemischte Trüffel mit und ohne Alkohol ca. 325 g Die Sorten können variieren!|Gemischte Trüffel mit und ohne Alkohol 25 Stück ca. 325 g|16.8|1', 778),
(375, 2, '10072|Aktiviert|Champagnertrüffel Flasche gefüllt mit Pralinen u. Trüffeln|320|1520||Champagnertrüffelflasche gefüllt mit Pralinen u. Trüffeln, Produkte, Pralinen & Gebäck|Eine au&szlig;ergew&ouml;hnliche Geschenkidee... Erlesene Pralinen u. Tr&uuml;ffel in einer Champagnerflasche. Die Original &bdquo;Champagne de Mailly&ldquo;-Flasche wird mit einer ausgesuchten Mischung von 25 Tr&uuml;ffel-Pralinen,die in Gold-Stanniol eingerollt sind, sorgf&auml;ltig gef&uuml;llt. Am Flaschenboden ist eine &Ouml;ffnung, durch die Sie bequem an die K&ouml;stlichkeiten kommen. Ein Geschenk mit Genuss!|320 g Netto Eine Champagnerflasche, die es in sich hat... mit Alkohol|24.9|1', 776),
(376, 2, '10073-12|Aktiviert|Gemischte Trüffel|155|405||Gemischte Trüffel, Onlineshop, Onlineshop, Pralinen & Gebäck, Pralinen & Gebäck, Weihnachten, Weihnachten|Ein wahrer Genuss. 12 Gemischte Trüffel mit und ohne Alkohol ca.155 g Die Sorten können variieren!|Gemischte Trüffel mit und ohne Alkohol 12 Stück ca.155 g|9.1|1', 777),
(370, 2, '10065-12|Aktiviert|Petits- Fours 12 Stck.|300|650||Petits- Fours 12 Stck., Produkte, Pralinen & Gebäck|Sie gelten als "Visitenkarte" einer gepflegten Konditorei. Daher z&auml;hlen unsere Petits-Fours zu unseren kreativen Glanzpunkten. Zu einem Glas Champagner oder einfach zwischen durch, sind sie immer ein kulinarischer und optischer Genuss. Saftiger spezieller englischer Biskuit wird mit feinsten Konfit&uuml;ren und verschiedenen aromatischen Cremes gef&uuml;llt und durch K&uuml;nstlerh&auml;nde ausgarniert. Die Petit-Fours bestehen aus 4 Geschmacksrichtungen: Whisky; Orangenlik&ouml;r; Kirschwasser und Weinbrand.|ca 300gSie gelten als "Visitenkarte" einer gepflegten Konditorei.mit Alkohol|17.55|1', 771),
(371, 2, '10065-16|Aktiviert|Petits-Fours 16 Stck.|400|750||Petits-Fours 16 Stck., Produkte, Pralinen & Gebäck|Sie gelten als "Visitenkarte" einer gepflegten Konditorei. F&uuml;r Ihre Kaffeetafel, als Dessert oder zu einem Glas Champagner, ein kulinarischer und optischer H&ouml;hepunkt. Saftiger englischer Biskuit wird mit feinsten Konfit&uuml;ren und verschiedenen Cremes gef&uuml;llt und durch K&uuml;nstlerh&auml;nde ausgarniert. Die Petits-Fours bestehen aus 4 Geschmacksrichtungen: Whisky; Orangenlik&ouml;r, Kirschwasser und Weinbrand.|400g Netto Petits-Fours f&uuml;r Gaumenfreunde mit Alkohol|22.5|1', 772),
(372, 2, '10071-12|Aktiviert|Champagner Trüffel|160|410||Champagner Trüffel, Produkte, Pralinen & Gebäck|12&nbsp;Champagner Tr&uuml;ffel sind wirklich eine kleine S&uuml;nde wert. Innen herrlich zart mit dem verf&uuml;hrerischen Prickeln der Champagner-Sahnetr&uuml;ffel-Masse, au&szlig;en umh&uuml;llt mit Vollmilch- und Zartbitter-Schokolade. Gek&uuml;hlt serviert schmecken sie am besten!|ca. 160 g St&uuml;ck f&uuml;r St&uuml;ck eine Verf&uuml;hrungmit Alkohol|9.3|1', 773),
(368, 2, '10054-36|Aktiviert|Strohauer`Pralinen|470|850||Strohauer`Pralinen, Produkte, Pralinen & Gebäck|36 Pralinen einer wahrlich k&ouml;niglichen Auswahl mit 12&nbsp;verschiedenen Sorten, die variieren k&ouml;nnen.|ca 500g Netto St&uuml;ck f&uuml;r St&uuml;ck ein wahres Vergn&uuml;gen mit Alkohol|23.5|1', 769),
(369, 2, '10065-4|Aktiviert|Petits- Fours 4 Stck.|100|350||Petits- Fours 4 Stck., Produkte, Pralinen & Gebäck|Sie gelten als "Visitenkarte" einer gepflegten Konditorei. Daher z&auml;hlen unsere Petits-Fours zu unseren kreativen Glanzpunkten. Zu einem Glas Champagner oder einfach zwischen durch, sind sie immer ein kulinarischer und optischer Genuss. Saftiger spezieller englischer Biskuit wird mit feinsten Konfit&uuml;ren und verschiedenen aromatischen Cremes gef&uuml;llt und durch K&uuml;nstlerh&auml;nde ausgarniert. Die Petit-Fours bestehen aus 4 Geschmacksrichtungen: Whisky; Orangenlik&ouml;r; Kirschwasser und Weinbrand.|ca 100gSie gelten als "Visitenkarte" einer gepflegten Konditorei.mit Alkohol|5.9|1', 770),
(363, 2, '10051-25|Aktiviert|Strohauer´s Weihnachtspralinen|315|665||Strohauer`s Weihnachtspralinen, Onlineshop, Onlineshop, Pralinen & Gebäck, Pralinen & Gebäck, Weihnachten, Weihnachten|25 Weihnachtspralinen, mit und ohne Alkohol, die auf der Zunge zergehen. Die Sorten können variieren.|Erlesenen Weihnachtspralinen ca. 315 g|17.3|1', 764),
