(367, 2, '10054-25|Aktiviert|Strohauer`Pralinen|345|695||Strohauer Pralinen, Produkte, Pralinen Gebäck|25 Pralinen einer wahrlich königlichen Auswahl mit 12 verschiedenen Sorten. Die Sorten können variieren!|ca. 345 g St&uuml;ck f&uuml;r St&uuml;ck ein wahres Vergn&uuml;genmit und ohne Alkohol|16.8|1', 768),
(364, 2, '10051-36|Aktiviert|Strohauer`s Weihnachtspralinen|440|790||Strohauer`s Weihnachtspralinen, Onlineshop, Onlineshop, Pralinen & Gebäck, Pralinen & Gebäck, Weihnachten, Weihnachten|36 ausgesuchte Weihnachtspralinen, mit und ohne Alkohol, die auf der Zunge zergehen. Ob Honig, Marzipan, Karamell oder Nougat, alle Pralinen sind ein Gedicht. Die Sorten können variieren.|Erlesenen Weihnachtspralinen ca. 440g|23.5|1', 765),
(365, 2, '10052|Aktiviert|Trüffelpralinen von Herzen|300|650||Trüffelpralinen von Herzen, Produkte, Pralinen & Gebäck|Die kleine Freude, sie kommt von Herzen. Ca. 300 g edle Tr&uuml;ffeln in einer aparten Herzschachtel. Das gibt sch&ouml;ne, genussvolle Stunden (24 Stck.) &ndash; gemischt.|ca. 300g Nicht nur zu Muttertag ein sch&ouml;nes Geschenk|17.9|1', 766),
