(361, 2, '10029/1|Aktiviert|Heidelberger Traumgebäck 500g|500|850||Heidelberger Traumgebäck 500g, Produkte, Pralinen & Gebäck|500 g Feinstes Teegeb&auml;ck, liebevoll f&uuml;r Sie zusammengestellt. Sie k&ouml;nnen das Geb&auml;ck auf Vorrat abgedeckt ins Tiefk&uuml;hlfach legen - in wenigen Minuten steht es f&uuml;r Sie zum Verzehr bereit. Es besteht aus Orangenduchesse, Makronenstreifen gef&uuml;llt mit Canache und Aprikosenkonfit&uuml;re, Eigelbmakronen, Florentinern, Orangenmarzipan, Mandelmoccageb&auml;ck, Orangenrahmzungen, Schokoladenrosetten, Florentinerschnitten, Mandelduchesse und englischen Mandelstreifen.|500 g Feinstes Teegeb&auml;ck, liebevoll f&uuml;r Sie zusammengestellt.|16|1', 762),
