(318, 2, '20061|Aktiviert|Baumkuchen Osternest|900|1250|Baumkuchen Osternest, Produkte, Ostern|Das Osternest wird Schicht f&uuml;r Schicht aus zartem Baumkuchenteig am offenem Feuer gebacken und sorgf&auml;ltig mit feinstem Edelfondant &uuml;berzogen. In der Mitte sitzt ein Osterh&auml;schen aus leckerer Edelvollmilchschokolade, kleine Tr&uuml;ffel- und Marzipank&ouml;stlichkeiten liegen zum Verteilen dabei. Das Baumkuchen Osternest ist nicht nur ein wahrer Augenschmaus f&uuml;r Ihre &ouml;sterliche Kaffeetafel, sondern auch eine ganz besonders schmackhafte Kuchenspezialit&auml;t.|H&ouml;he 11 cm 600g Ein Augenschmaus f&uuml;r Ihre &ouml;sterliche Kaffeetafel|27.5|1', 719),
(319, 2, '20062|Aktiviert|Strohauer`s Osterlamm|500|850|Strohauer`s Osterlamm, Produkte, Ostern|&Uuml;berraschen Sie Ihre Familie oder Ihre G&auml;ste mit diesem originellen Osterlamm. Aus leichtem Butter-Biskuit wird es nach einem alten &uuml;berlieferten franz&ouml;sischen Rezept aus Butter, Zucker, Eiern und Mehl gebacken. Mit seinem flaumigen Puderzuckerfell wird es unwiderstehlich und bildet einen geschmackvollen Mittelpunkt des traditionellen Osterfestes.|500g Netto Zum Anschneiden fast zu schade|14.5|1', 720),
