(280, 2, '10013|Aktiviert|Handgeschöpfte Schokolade gemischt 300g||300|Handgeschöpfte Schokolade|Die Handgeschöpfte Schokolade wird nach original Schweizer Rezepturen ganz traditionell von Hand hergestellt. Erlesene Zutaten und sorgfältige Verarbeitung bürgen für ihre excellente Qualität. Ganze Nüsse, karamellisierte Mandeln,Floreniner mit Sahne, oder Fruchtstücke werden mit geschmolzener Schokolade vermischt, anschließend wird die Masse gleichmäßig auf eine Platte gegossen. In einer Tüte gemischt je 100g.|Schokoladen-Genuss in höchster Frische|11.4|1', 681),
(273, 2, '20020|Aktiviert|Käse-Mohn Kuchen NEU|1850|2200|Käse-Mohn Kuchen, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten|Zutaten wie unser Käse- Rahm Kuchen nur noch mit einer Schicht Mohn.|26 cm Ø 1850 g Unser leckerer Käse-Rahm Kuchen wird mit einer Schicht Mohn zu einem vollkommenen neuen Geschmackserlebnis|22.5|1', 674),
(274, 2, '20019|Aktiviert|"Wochenendkuchen" Linzertorte NEU|1350|1700||"Wochenendkuchen" Linzertorte NEU, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten|Unsere Linzertorte wird nur mit ausgesuchten Rohstoffen und Gewürzen nach einem alten Rezept, hergestellt. Makronenmasse, Butter,Zucker, Eier,Mandeln,Nüsse,Mehl und Gewürze werden zu einem saftigen Teig verknetet. Gefüllt wird die Torte mit einer feinen Himbeer-Johannisbeer Marmelade. Auch ohne Kühlung lange haltbar!|Ein unvergleichlicher Genuss;- nicht nur zur Winterzeit 26 cm Ø 1350 g|23.5|1', 675),
(270, 2, '90001|Aktiviert|Schwarz-weiße Hochzeitstorte||0|Schwarz-weiße Hochzeitstorte, Hochzeitstorten|Bei dieser 5 stöckigen Hochzeitstorte können für jedes Stockwerk eine andere Geschmacksrichtung aussuchen. Diese hier bestand nur aus fruchtiger Füllung. zB. Mangosahne, Himbeersahne Erdbeer-Joghurt, Mandarinensahne und Viktoriatorte.|Nur für Selbstabholer!!! 60-70 Personen Nur auf Bestellung|280|1', 671),
(271, 2, '90000|Aktiviert|Doppelherz||0|Doppelherz, Hochzeitstorten|Doppelherz in weiß und rot gehalten. Geschmacksrichtung und Verziehrung können Sie nach Belieben selbst bestimmen. Diese Torte war eine Sachermasse und das andere Herz war eine Viktoriatorte. Überzogen war sie mit einem weichen Zuckerfondant.|Nur für Selbstabholer 50-60 Personen Nur auf Bestellung|250|1', 672),
(272, 2, '20021|Aktiviert|Käse-Kirsch Kuchen NEU|1850|2200||Käse-Mohn Kuchen, Onlineshop, Kuchen & Torten, Traditionelle Kuchen & Torten|Wer keinen Mohn mag, kann auch auf die Käse-Kirsch Variante ausweichen. Zutaten wie unser Käse- Rahm Kuchen nur noch mit einer Schicht Kirschmasse.|26 cm Ø 1850 g Eine andere Variante zum Käse-Mohn.|22.5|1', 673),
(268, 2, '90003|Aktiviert|Doppelherz mit Himbeeren||0|Doppelherz mit Himbeeren, Hochzeitstorten|Das eine Herz besteht aus einer Himbeersahne, belegt mit frischen Himbeeren. Das andere Herz aus einer Sachertorte. Natürlich können sie auch eine andere Füllung bestimmen.|Nur für Selbstabholer 50-60 Personen Nur auf Bestellung|250|1', 669),
(269, 2, '90002|Aktiviert|Viereckige Hochzeitstorte mit Herz||0|Viereckige Hochzeitstorte mit Herz, Hochzeitstorten|Bei dieser Hochzeitstorte richten wir uns natürlich auch nach Ihren Wünschen. Diese wurde Torte wurde mit Marzipan überzogen. Die Geschmacksrichtung war Erdbeer- Joghurt. Das Herz war unsere beliebte Sachertorte.|Nur für Selbstabholer 50-60 Personen Nur auf Bestellung|250|1', 670),
(267, 2, '90004|Aktiviert|Hochzeitstorte||0|Hochzeitstorte , Hochzeitstorten|Diese aufgesetzte Hochzeitstorte bestand aus einer Sachertorte und einer Viktoriatorte. Überzogen wurde sie mit einem weichen Fondant.|Nur für Selbstabholer für ca. 15 Personen Nur auf Bestellung|70|1', 668),
(266, 2, '90005|Aktiviert|Dreistöckige Hochzeitstorte mit Blumenbukett||0|Dreistöckige Hochzeitstorte mit Blumenbukett, Hochzeitstorten|Diese Hochzeitstorte besticht durch ihre Eleganz. Selbstverständlich können Sie jedes Stockwerk mit einer anderen Geschmacksrichtung füllen lassen. Das Zuckerbukett kann man nicht mitessen. Die Torte wurde mit einem weichen Fondant eingeschlagen.|Nur für Selbstabholer 50-60 Personen Nur auf Bestellung|280|1', 667),
(265, 2, '90006|Aktiviert|Großes Erdbeerherz||0|Großes Erdbeerherz, Hochzeitstorten|In der Saison! Ein großes Erdbeerherz.|Nur für Selbstabholer 40-50 Personen Auf Anfrage|130|1', 666),
(263, 2, '40008|Aktiviert|Weihnachtszeit|1000|2700|Weihnachtszeit, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente|Unser beliebter Strohauers Original Heidelberger Christstollen haben wir mit einer Flasche Palio Natale Secco kombiniert. Mit Alkohol (Christstollen 1000 g. Secco 0,750l)|Der besondere Genuss zur Weihnachtszeit|21.5|1', 664),
(264, 2, '90007|Aktiviert|Große Viktoria-Torte||0|Große Viktoria-Torte, Hochzeitstorten|Die Viktoriatorte können Sie in verschiedenen Größen als Hochzeitstorte bestellen, daher variiert auch der Preis.|für Selbstabholer Personenzahl beliebig Nur auf Bestellung|270|1', 665),
(262, 2, '90008|Aktiviert|Weiße Dame||0|Weiße Dame, Onlineshop, Hochzeit, Festliche Anlässe|Diese Hochzeitstorte besticht durch ihre Eleganz. Sie bestand aus den Füllungen: Schwarzwäldertorte, Nußsahnetorte und Käsesahnetorte. Die Marzipanblumen werden farblich Ihrer Tischdeko angepasst. Sie können die Füllungen natürlich auch nach Ihrem Geschmack bestellen. Für ca 60 Personen|Nur für Selbstabholer|280|1', 663),
(261, 2, '90009|Aktiviert|Nashorn-Jubiläumstorte||100|Nashorn-Jubiläumstorte, Onlineshop, Jubiläum, Festliche Anlässe|Diese Torte war für das Augustinum. Die Nashörner haben wir selbst aus Marzipan hergestellt. Jedes Stockwerk hat eine andere Füllung.|Nur für Selbstabholer|350|1', 662),
(260, 2, '40009|Aktiviert|Deutsch-Französische Komposition|1000|1750|Deutsch-französische Komposition|ca. 150 km. südöstlich von Bordeaux kommt dieser köstliche Sauvignon.Das Weingut Maison Rigal ist seit 1755 der Spezialist für Weine aus dem Südwesten Frankreichs. Leuchtende Farbe mit hellgelben Reflexen. Intensiver, lebhafter Duft mit blumigen Noten. Im Mund kräftig und trocken mit Aromen von Stchelbeere, Passionsfrüchte und Pampelmuse. Idealer Begleiter von Spargel, Schalen und Krustentieren, Fisch und auch Geflügelgerichten. Diesen Excellenten Wein haben wir mit unserem Christstollen und feinen Weihnachtspralinen kombiniert.|Ein excellenter Wein kombiniert mit unserem außergewöhnlichen Heidelberger Christstollen (500 gr.), und 6 Weihnachtspralinen. Sie können uns auch anrufen und aus unserem reichhaltigen Angebot sich selbst ein Präsent zusammenstellen.|22.5|1', 661),
(259, 2, '40010|Aktiviert|Deutsch-Französische Freundschaft||1700|Deutsch-Französische Freundschaft, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente|Dieser Wein kommt aus der Kellerei Maison Rigal, die seit 1755 der Spezialist für Weine aus dem Südwesten Frankreichs ist. Rebsorte: 100% Gros Manseng Goldene Farbe. Intensives Bukett, in dem sich Noten von getrockneten Aprikosen und exotischen Früchten mischen. Am Gaumen sehr schön ausgewogen, mit Aromen von kandierten Früchten,Quitten, Feigen und Honig. Durch die feine Säure wirkt der Wein wunderbar erfrischend im Abgang. Als Aperitif, zu Desserts oder einfach zum Geniesen. Referenzen: Goldmedaille Concours National des Vins IGP de France 2012 für den 2011er.|Diesen lieblichen Wein haben wir mit einem 500 gr. Mandelmarzipanstollen und edlen Weihnachtspralinen kombiniert und in einen weihnachtlichen Geschenkkarton verpackt.|26|1', 660),
(258, 2, '40011|Aktiviert|gemischte Weihnachtskiste|1230|2700|gemischte Weihnachtskiste, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente|Marzipan-Mandelstollen (500 gr), Früchtebrot (500 gr.) eine kl. Flasche (0,2l) Palio Natale Secco, 6 Weihnachtspralinen mit Alkohol in einer Schachtel (können variieren) und ein Ring Baumkuchen (ca. 150 gr) wird in einen wunderschönen Geschenkkarton verpackt.|weihnachtliche Spezialitäten haben wir zu einem schönen Präsent zusammen gestellt.|32|1', 659),
(257, 2, '40012|Aktiviert|Präsent Christkindel||1550|Präsent Christkindel, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente|Pistazienstollen (500 gr.), eine kl. Flasche (0,2l) Palio Natale Secco, 6 Weihnachtspralinen mit Alkohol ( können variieren), und ein Ring Baumkuchen (ca. 150 gr) haben wir für Sie in einem weihnachtlichen Geschenkkarton zusammen gestellt.|Eine bunte Zusammenstellung diverser Weihnachtsartikel|26.5|1', 658),
(256, 2, '40013|Aktiviert|Präsent Advent|580|1350|Präsent Advent, Präsente & Geschenke, Onlineshop, Weihnachten, gemischte Präsente|Marzipan-Mandelstollen 500 gr, eine kl. Flasche (0,2l) Palio Natale Secco, und 6 Weihnachtspralinen mit Alkohol ( können variieren) haben wir in einem schönen Weihnachtspräsentkarton zusammen gestellt.|Für einen gemütlichen Abend daheim|22|1', 657),
(255, 2, '20261|Aktiviert|Strohauer''s Original Heidelberger Christstollen © 500 g|500|850|Strohauer`s Original Heidelberger Christstollen 1500 g|In 180 L&auml;ndern auf allen Kontinenten gilt Strohauer''s Christstollen als "Botschafter aus Heidelberg" - und das nicht ohne Grund! Erlesene Zutaten wie die gr&ouml;&szlig;ten, saftigsten, 48 Stunden in Rum geweichten Sultaninen, Vanille, Mandeln, Orangeat, Zitronat, Rohmarzipan und exotische Gew&uuml;rze verleihen ihm seine aromatische Saftigkeit. Verpackt in einer weihnachtlichen Tüte.|Er darf auf keiner Festtafel fehlen|8.5|1', 656),
(254, 2, '20079|Aktiviert|Mandel Marzipan Stollen 500g|500|850|Marzipan Mandel Stollen 1000g, Produkte, Weihnachten|Der zarte Butterteig wird aus vielen gehackten Mandeln hergestellt und mit einer saftigen Marzipanrolle gef&uuml;llt. Nach dem Backen wird der Stollen gebuttert und mit Vanille- und Puderzucker best&auml;ubt.|Eine Alternative zum original Heidelberger Christstollen|13|1', 655),
(253, 2, '20183|Aktiviert|Pistazien Marzipan Stollen 500 g|500|850|Pistazien Marzipan Stollen 1000 g, Produkte, Weihnachten|Der Stollen wird aus feinem Butterteig hergestellt, der eine saftige Marzipanrolle umh&uuml;llt. Nach dem Backen wird er mit einer Aprikosen-Konfit&uuml;re bestrichen und mit vielen gehackten, frischen Pistazien bestreut.|Kenner lieben dieses Naschwerk|14.75|1', 654),
(250, 2, '20037|Aktiviert|Cassata-Torte|2100|2400||Cassata-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Angebote, Angebote|Rumgetränkter Biskuit, Amarenakirschen, Sultaninen, in Cointreau eingelegte Mandarinen und kandierte Kirschen werden mit einer Kirschwassercreme vermengt. Umhüllt wird diese feine Mischung von einer mit Zartbitterschokolade überzogenen Marzipandecke. Der Boden besteht aus einem lockeren Nussbiskuit.|Neu in unserem Versand! Eine Torte für den Rumpunschliebhaber! Ø 26cm|28|1', 652),
(252, 2, '20025|Aktiviert|Königin-Silvia-Torte|1600|2000||Königin-Silvia-Torte, Onlineshop, Onlineshop, Kuchen & Torten, Kuchen & Torten, Traditionelle Kuchen & Torten, Traditionelle Kuchen & Torten|Altfranzösischer saftiger Biskuit, wird reichlich getränkt mit Kirschwasser, eingedeckt mit Marzipan und überzogen mit weißer Schokolade. Als Boden dient ein knuspriger Mürbeteig. Frische Pistazien und Belegkirschen runden diese Kreation ab.|Anlässlich zur Hochzeit des Schwedischen Königspaares wurde diese Torte 1976 kreiert und dann dem Paar überreicht. Jetzt haben wir diese königliche Torte wieder im Programm. Gewicht 1600g Ø 26cm|27.5|1', 653),
