(5, 'Home page', 'one_column', '', '', 'home', '', '<!-- this homepage can be used for modern theme  -->\r\n{{block type="core/template" template="sample/home.phtml"}}', '2008-04-16 11:51:52', '2008-08-08 09:23:12', 0, 0, '<!--<reference name="content">\r\n<block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page"><action method="addPriceBlockType"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n<block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new"><action method="addPriceBlockType"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n<block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed"><action method="addPriceBlockType"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n</reference><reference name="right">\r\n<action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n<action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n</reference>-->', '', '', NULL, NULL, NULL),
(6, 'Enable Cookies', 'one_column', '', '', 'enable-cookies', '', '<div class="std">\r\n    <ul class="messages">\r\n        <li class="notice-msg">\r\n            <ul>\r\n                <li>Please enable cookies in your web browser to continue.</li>\r\n            </ul>\r\n        </li>\r\n    </ul>\r\n    <div class="page-title">\r\n        <h1><a name="top"></a>What are Cookies?</h1>\r\n    </div>\r\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website. On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically whenever you visit our site so that we can personalize your experience and provide you with better service. We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes. If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase or take advantage of certain features of our website, such as storing items in your Shopping Cart or receiving personalized recommendations. As a result, we strongly encourage you to configure your web browser to accept cookies from our website.</p>\r\n    <h2 class="subtitle">Enabling Cookies</h2>\r\n    <ul class="disc">\r\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\r\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\r\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\r\n        <li><a href="#opera">Opera 7.x</a></li>\r\n    </ul>\r\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Start Internet Explorer</p>\r\n        </li>\r\n        <li>\r\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Privacy</strong> tab</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Advanced</strong> button</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>, put another check mark in the <strong>Always accept session cookies </strong>box</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Restart Internet Explore</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\r\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> tab</p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>) under <strong>Settings</strong>. Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Expand the <strong>Cookies</strong> section</p>\r\n        </li>\r\n        <li>\r\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="opera"></a>Opera 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong> should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n</div>\r\n', '2011-10-24 10:21:43', '2011-10-24 10:21:43', 1, 0, NULL, NULL, '', NULL, NULL, NULL),
(7, 'Privacy Policy', 'one_column', NULL, NULL, 'privacy-policy-cookie-restriction-mode', 'Privacy Policy', '<p style="color: #ff0000; font-weight: bold; font-size: 13px">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path="general/store_information/name"}} uses and protects any information\n    that you give {{config path="general/store_information/name"}} when you use this website.\n    {{config path="general/store_information/name"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path="general/store_information/name"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href="#list">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer''s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path="trans_email/ident_general/email"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path="general/store_information/address"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name="list"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class="data-table">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>', '2013-02-15 06:22:02', '2013-02-15 06:22:02', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'Template Home page', 'one_column', NULL, NULL, 'template_home', NULL, '<div class="white-container clearfix">{{block type="slideshowtimeline/slideshowtimeline" name="slideshowtimeline" template="codevog/slideshowtimeline/slideshowtimeline.phtml" }}<br />\r\n<div class="clear">&nbsp;</div>\r\n<p>{{block type="codevog_news/shownews" template="codevog/news/homenews.phtml"}}{{block type="templateslider/slider" template="codevog/templateslider/slider.phtml"}}</p>\r\n</div>', '2013-02-15 06:26:06', '2013-02-18 13:32:15', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Template 404 No Route page', 'one_column', NULL, NULL, 'template_no_route', NULL, '<div class="col-main-left">\n                    <div class="page-head-alt">\n                    <h3>Whoops, our bad...</h3>\n                    </div>\n                    <dl> <dt>The page you requested was not found, and we have a fine guess why.</dt> <dd>\n                    <ul class="disc">\n                    <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n                    <li>If you clicked on a link to get here, the link is outdated.</li>\n                    </ul>\n                    </dd> </dl>\n                    <p>&nbsp;</p>\n                    <dl> <dt>What can you do?</dt> <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Demo Store.</dd> <dd>\n                    <ul class="buttons">\n                    <li><button class="button" onclick="history.go(-1);"><span><span>Go back</span></span></button></li>\n                    <li><button class="button" onclick="location.href=''{{store url=''''}}''"><span><span>Store Home</span></span></button></li>\n                    <li><button class="button" onclick="location.href=''{{store url=''customer/account''}}''"><span><span>My Account</span></span></button></li>\n                    </ul>\n                    </dd></dl></div>\n                    <div class="col-right">\n                    <div class="banner"><a href="#"><img src="{{media url="codevog/template/right_banner1.jpg" }}" alt="" /></a></div>\n                    <div class="banner"><a class="text-right" href="#"><img src="{{media url="codevog/template/right_banner2.jpg" }}" alt="" /><span>SEASON<br />DISCOUNTS</span></a></div>\n                    </div>', '2013-02-15 06:26:07', '2013-02-15 06:26:07', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'Impressum', 'one_column', NULL, NULL, 'impressum', NULL, '<h1>DISCLAIMER</h1>\r\n\r\n<p>Die hier bereitgestellten Mustertexte sind ausdrücklich als \r\n<strong>MUSTER</strong> zu verstehen und müssen in jedem Fall durch \r\neigene rechtssichere Texte unter CMS -> Statische Blöcke ersetzt \r\nwerden. Weder germansetup gmbh noch Trusted Shops tragen für die\r\nRichtigkeit und Vollständigkeit dieser Texte eine Verantwortung.</p>\r\n\r\n<h2>Impressum (Muster)</h2>\r\n\r\n<h3>{{block type="germansetup/imprint_field" value="shop_name"}}</h3>\r\n\r\n<p>{{block type="germansetup/imprint_content" template="germansetup/imprint/address.phtml"}}</p>\r\n\r\n<p>{{block type="germansetup/imprint_content" template="germansetup/imprint/communication.phtml"}}</p>\r\n\r\n<p>{{block type="germansetup/imprint_content" template="germansetup/imprint/legal.phtml"}}</p>\r\n\r\n<p>{{block type="germansetup/imprint_content" template="germansetup/imprint/bank.phtml"}}</p>\r\n\r\n<p>{{block type="germansetup/imprint_field" value="business_rules"}}</p>\r\n\r\n<p>Sie erreichen unseren Kundendienst für Fragen Reklamationen und Beanstandungen unter Telefon: {{block type="germansetup/imprint_field" value="telephone"}} sowie per Email unter <a href="mailto:{{block type="germansetup/imprint_field" value="email"}}">{{block type="germansetup/imprint_field" value="email"}}</a>. Für Anfragen können Sie auch das Kontaktformular auf unserer Internetseite nutzen.</p>\r\n\r\n<h3>Disclaimer (Muster)</h3>\r\n\r\n<p>Bei direkten oder indirekten Verweisen auf fremde Webseiten ("Hyperlinks"), die außerhalb des Verantwortungsbereiches des Autors liegen, würde eine Haftungsverpflichtung ausschließlich in dem Fall in Kraft treten, in dem der Autor von den Inhalten Kenntnis hat und es ihm technisch möglich und zumutbar wäre, die Nutzung im Falle rechtswidriger Inhalte zu verhindern. Der Autor erklärt hiermit ausdrücklich, dass zum Zeitpunkt der Linksetzung keine illegalen Inhalte auf den zu verlinkenden Seiten erkennbar waren. Auf die aktuelle und zukünftige Gestaltung, die Inhalte oder die Urheberschaft der verlinkten/verknüpften Seiten hat der Autor keinerlei Einfluss. Deshalb distanziert er sich hiermit ausdrücklich von allen Inhalten aller verlinkten /verknüpften Seiten, die nach der Linksetzung verändert wurden. Diese Feststellung gilt für alle innerhalb des eigenen Internetangebotes gesetzten Links und Verweise sowie für Fremdeinträge in vom Autor eingerichteten Gästebüchern, Diskussionsforen, Linkverzeichnissen, Mailinglisten und in allen anderen Formen von Datenbanken, auf deren Inhalt externe Schreibzugriffe möglich sind. Für illegale, fehlerhafte oder unvollständige Inhalte und insbesondere für Schäden, die aus der Nutzung oder Nichtnutzung solcherart dargebotener Informationen entstehen, haftet allein der Anbieter der Seite, auf welche verwiesen wurde, nicht derjenige, der über Links auf die jeweilige Veröffentlichung lediglich verweist.</p>\r\n\r\n<h3>Urheber- und Kennzeichenrecht</h3>\r\n\r\n<p>Der Autor ist bestrebt, in allen Publikationen die Urheberrechte der verwendeten Bilder, Grafiken, Tondokumente, Videosequenzen und Texte zu beachten, von ihm selbst erstellte Bilder, Grafiken, Tondokumente, Videosequenzen und Texte zu nutzen oder auf lizenzfreie Grafiken, Tondokumente, Videosequenzen und Texte zurückzugreifen. Alle innerhalb des Internetangebotes genannten und ggf. durch Dritte geschützten Marken- und Warenzeichen unterliegen uneingeschränkt den Bestimmungen des jeweils gültigen Kennzeichenrechts und den Besitzrechten der jeweiligen eingetragenen Eigentümer. Allein aufgrund der bloßen Nennung ist nicht der Schluss zu ziehen, dass Markenzeichen nicht durch Rechte Dritter geschützt sind! Das Copyright für veröffentlichte, vom Autor selbst erstellte Objekte bleibt allein beim Autor der Seiten. Eine Vervielfältigung oder Verwendung solcher Grafiken, Tondokumente, Videosequenzen und Texte in anderen elektronischen oder gedruckten Publikationen ist ohne ausdrückliche Zustimmung des Autors nicht gestattet.</p>\r\n\r\n<p>Inhaltlich verantwortlich gemäß § 5 TMG ist {{block type="germansetup/imprint_field" value="ceo"}}, Kontaktdaten siehe oben. </p>', '2013-02-26 07:25:48', '2013-02-26 07:25:48', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 'Zahlungsarten', 'one_column', NULL, NULL, 'zahlung', NULL, '<h1>DISCLAIMER</h1>\r\n\r\n<p>Die hier bereitgestellten Mustertexte sind ausdrücklich als \r\n<strong>MUSTER</strong> zu verstehen und müssen in jedem Fall durch \r\neigene rechtssichere Texte unter CMS -> Statische Blöcke ersetzt \r\nwerden. Weder germansetup gmbh noch Trusted Shops tragen für die\r\nRichtigkeit und Vollständigkeit dieser Texte eine Verantwortung.</p>\r\n\r\n<h2>Zahlungsarten</h2>\r\n\r\n<p>Wir bieten Ihnen folgende Zahlungsarten an. Suchen Sie sich einfach die für Sie optimale Zahlart aus. Die Versandkosten sind teilweise abhängig von der gewählten Zahlungsart.</p>\r\n\r\n<h3>Vorkasse</h3>\r\n\r\n<p>Kostenloser Versand innerhalb Deutschlands (Außer Express-Versand)</p>\r\n<p>Bitte überweisen Sie den Gesamtbetrag Ihrer Bestellung auf unser Konto:</p>\r\n<p>{{block type="germansetup/imprint_content" template="germansetup/imprint/email/footer.phtml"}}</p>\r\n\r\n<h3>Rechnung</h3>\r\n\r\n<p>Nur für Schulen, Behörden und im Handelsregister eingetragene Unternehmen nach Prüfung.</p>\r\n\r\n<h3>Nachnahme</h3>\r\n\r\n<p>Bitte halten Sie den Rechnungsbetrag bereit; der Zusteller kassiert bei Lieferung in bar (keine Schecks). Bei Nachnahme fallen zusätzlich 2,-- EUR Nachnahmegebühren an, die direkt an den Paketzusteller zu entrichten sind.</p>\r\n\r\n<h3>Lastschrift</h3>\r\n\r\n<p>Wir ziehen den Rechnungsbetrag Ihrer Bestellung von Ihrem hinterlegten Bankkonto nach der getätigten Bestellung ein.</p>', '2013-02-26 07:25:48', '2013-02-26 07:25:48', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 'Datenschutz', 'one_column', NULL, NULL, 'datenschutz', NULL, '<h2><i>Fügen Sie hier Ihre Datenschutzerklärung ein.</i></h2>\r\n', '2013-02-26 07:25:48', '2013-02-26 07:25:48', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(15, 'Lieferung', 'one_column', NULL, NULL, 'lieferung', NULL, '<h2><i>Fügen Sie hier Ihre Versandkostenaufstellung und weitere Einzelheiten zur Lieferung ein.</i></h2>\r\n', '2013-02-26 07:25:48', '2013-02-26 07:25:48', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(16, 'Bestellvorgang', 'one_column', NULL, NULL, 'bestellung', NULL, '<h1>DISCLAIMER</h1>\r\n\r\n<p>Die hier bereitgestellten Mustertexte sind ausdrücklich als \r\n<strong>MUSTER</strong> zu verstehen und müssen in jedem Fall durch \r\neigene rechtssichere Texte unter CMS -> Statische Blöcke ersetzt \r\nwerden. Weder germansetup gmbh noch Trusted Shops tragen für die\r\nRichtigkeit und Vollständigkeit dieser Texte eine Verantwortung.</p>\r\n\r\n<h2>Bestellvorgang, einfach und bequem bestellen</h2>\r\n\r\n<h3>Wie kann ich bei {{block type="germansetup/imprint_field" value="shop_name"}} bestellen?</h3>\r\n\r\n<h4>1. Warenkorb</h4>\r\n\r\n<p>Wählen Sie die Produkte aus, die Sie bestellen möchten, indem Sie den "In den Warenkorb" Button anklicken. Dadurch wird Ihre Auswahl in den Warenkorb gelegt. Sie können diese Auswahl bis zum Absenden Ihrer Bestellung jederzeit ändern, in dem Sie die Anzahl der Produkte ändern, durch Anklicken des Kästchens "Entfernen" die Auswahl löschen oder den Bestellvorgang abbrechen. Durch Anklicken des Buttons "Kasse" gelangen Sie zum nächsten Bestellschritt.</p>\r\n\r\n<h4>2. Kasse</h4>\r\n\r\n<p>Melden Sie sich bitte mit Ihrer eMail Adresse und Ihrem Passwort an falls Sie bereits ein Kundenkonto besitzen, ansonsten registrieren Sie sich bitte als neuer Kunde. Ihre Daten werden unter Beachtung der datenschutzrechtlichen Bestimmungen erhoben, verarbeitet und genutzt (<a href="{{store url="datenschutz"}}">Datenschutzhinweis</a>). Eine anderweitige Verwendung oder Weitergabe an Dritte erfolgt nicht. Sind Sie bereits angemeldet, können Sie nun die Versandart auswählen. Durch klicken des Buttons "Weiter" gelangen Sie zum nächsten Bestellschritt.</p>\r\n\r\n<h4>3. Rechnungsadresse prüfen / Zahlungsweise auswählen</h4>\r\n\r\n<p>Überprüfen Sie nun Ihre Rechnungsadresse und geben Sie Ihre gewünschte <a href="{{store url="zahlung"}}">Zahlungsweise</a> an. Durch Klicken des Buttons "Weiter" gelangen Sie zum nächsten Bestellschritt. </p>\r\n\r\n<h4>4. Versandadresse prüfen / Versandart auswählen</h4>\r\n\r\n<p>Überprüfen Sie nun Ihre Versandadresse und geben Sie Ihre gewünschte <a href="{{store url="lieferung"}}">Versandart</a> an. Durch Klicken des Buttons "Weiter" gelangen Sie zum nächsten Bestellschritt.</p>\r\n\r\n<h4>5. Bestellvorgang abschließen / AGB und Datenschutz</h4>\r\n\r\n<p>Sie erhalten eine Übersicht Ihrer Bestellung: die ausgewählten Produkte, die Versand- und Rechnungsadresse und Ihre Kontaktdaten. Überprüfen Sie, ob alle Angaben stimmen und lesen sich bitte die <a href="{{store url="agb"}}">Allgemeinen Geschäftsbedingungen</a> und die <a href="{{store url="widerruf"}}">Widerrufsbelehrung</a> aufmerksam durch. Sie können mit der Bestellung nur fortfahren, wenn Sie den AGB und der Widerrufsbelehrung zustimmen (Häkchen setzen). Mit dem Anklicken des Buttons "Jetzt kaufen" übersenden Sie Ihre Bestellung an uns. Hiermit geben Sie ein rechtsverbindliches Angebot ab.</p>\r\n\r\n<h4>Widerrufsrecht für Verbraucher</h4>\r\n\r\n<p>Alle Informationen zum <a href="{{store url="agb#widerruf"}}">Widerrufsrecht</a></p>', '2013-02-26 07:25:49', '2013-02-26 07:25:49', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
