ign="center" style="background:#EAEAEA; text-align:center;"><center><p style="font-size:12px; margin:0;">Thank you again, <strong>{{var store.getFrontendName()}}</strong></p></center></td>\n            </tr>\n        \n                        \n                        <tr>\n                            <td>\n                                {{block type="germansetup/imprint_content" template="germansetup/imprint/email_footer.phtml"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\n    </td>\n</tr>\n</table>\n</div>\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, '{{var store.getFrontendName()}}: Order # {{var order.increment_id}} update', NULL, NULL, NULL, '2013-02-26 07:25:52', NULL, NULL);
