</tr>\n                        \n                    </table>\n    </td>\n</tr>\n</table>\n</div>\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, '{{var store.getFrontendName()}}: Shipment # {{var shipment.increment_id}} for Order # {{var order.increment_id}}', NULL, NULL, NULL, '2013-02-26 07:25:53', NULL, NULL);
INSERT INTO `core_email_template` (`template_id`, `template_code`, `template_text`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `added_at`, `modified_at`, `orig_template_code`, `orig_template_variables`) VALUES
(24, 'Lieferung Aktualisierung (Template)', '\n\n\n\n<body style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<div style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<table cellspacing="0" cellpadding="0" border="0" height="100%" width="100%">\n<tr>\n    <td align="center" valign="top" style="padding:20px 0 20px 0">\n        <!-- [ header starts here] -->\n        <table bgcolor="#FFFFFF" cellspacing="0" cellpadding="10" border="0" width="650" style="border:1px solid #E0E0E0;">\n            <tr>\n                <td valign="top"><a href="{{store url=""}}"><img src="{{var logo_url}}" alt="{{var logo_alt}}" style="margin-bottom:10px;" border="0"/></a></td>\n            </tr>\n            <!-- [ middle starts here] -->\n            <tr>\n                <td valign="top">\n                    <h1 style="font-size:22px; font-weight:normal; line-height:22px; margin:0 0 11px 0;">Dear {{htmlescape var=$order.getCustomerName()}},</h1>\n                    <p style="font-size:12px; line-height:16px; margin:0 0 10px 0;">\n                        Your order # {{var order.increment_id}} has been <br/>\n                        <strong>{{var order.getStatusLabel()}}</strong>.\n                    </p>\n                    <p style="font-size:12px; line-height:16px; margin:0 0 10px 0;">You can check the status of your order by <a href="{{store url="customer/account/"}}" style="color:#1E7EC8;">logging into your account</a>.</p>\n                    <p style="font-size:12px; line-height:16px; margin:0 0 10px 0;">{{var comment}}</p>\n                    <p style="font-size:12px; line-height:16px; margin:0;">\n                        If you have any questions, please feel free to contact us at\n                        <a href="mailto:{{config path=''trans_email/ident_support/email''}}" style="color:#1E7EC8;">{{config path=''trans_email/ident_support/email''}}</a>\n                        or by phone at {{config path=''general/store_information/phone''}}.\n                    </p>\n                </td>\n            </tr>\n            <tr>\n                <td bgcolor="#EAEAEA" align="center" style="background:#EAEAEA; text-align:center;"><center><p style="font-size:12px; margin:0;">Thank you again, <strong>{{var store.getFrontendName()}}</strong></p></center></td>\n            </tr>\n        \n                        \n                        <tr>\n                            <td>\n                                {{block type="germansetup/imprint_content" template="germansetup/imprint/email_footer.phtml"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\n    </td>\n</tr>\n</table>\n</div>\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, '{{var store.getFrontendName()}}: Shipment # {{var shipment.increment_id}} update', NULL, NULL, NULL, '2013-02-26 07:25:53', NULL, NULL),
(25, 'Lieferung Aktualisierung Gast (Template)', '\n\n\n\n<body style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<div style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<table cellspacing="0" cellpadding="0" border="0" height="100%" width="100%">\n<tr>\n    <td align="center" valign="top" style="padding:20px 0 20px 0">\n        <!-- [ header starts here] -->\n        <table bgcolor="#FFFFFF" cellspacing="0" cellpadding="10" border="0" width="650" style="border:1px solid #E0E0E0;">\n            <tr>\n                <td valign="top"><a href="{{store url=""}}"><img src="{{var logo_url}}" alt="{{var logo_alt}}" style="margin-bottom:10px;" border="0"/></a></td>\n            </tr>\n            <!-- [ middle starts here] -->\n            <tr>\n                <td valign="top">\n                    <h1 style="font-size:22px; font-weight:normal; line-height:22px; margin:0 0 11px 0;">Dear {{htmlescape var=$billing.getName()}},</h1>\n                    <p style="font-size:12px; line-height:16px; margin:0 0 10px 0;">\n                        Your order # {{var order.increment_id}} has been <br/>\n                        <strong>{{var order.getStatusLabel()}}</strong>.\n                    </p>\n                    <p style="font-size:12px; line-height:16px; margin:0 0 10px 0;">{{var comment}}</p>\n                    <p style="font-size:12px; line-height:16px; margin:0;">\n                        If you have any questions, please feel free to contact us at\n                        <a href="mailto:{{config path=''trans_email/ident_support/email''}}" style="color:#1E7EC8;">{{config path=''trans_email/ident_support/email''}}</a>\n                        or by phone at {{config path=''general/store_information/phone''}}.\n                    </p>\n                </td>\n            </tr>\n            <tr>\n                <td bgcolor="#EAEAEA" align="center" style="background:#EAEAEA; text-align:center;"><center><p style="font-size:12px; margin:0;">Thank you again, <strong>{{var store.getFrontendName()}}</strong></p></center></td>\n            </tr>\n        \n                        \n                        <tr>\n                            <td>\n                                {{block type="germansetup/imprint_content" template="germansetup/imprint/email_footer.phtml"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\n    </td>\n</tr>\n</table>\n</div>\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, '{{var store.getFrontendName()}}: Shipment # {{var shipment.increment_id}} update', NULL, NULL, NULL, '2013-02-26 07:25:53', NULL, NULL),
(26, 'Zahlung fehlgeschlagen (Template)', '\n\n\n<table>\n    <thead>\n        <tr>\n            <th>Payment transaction failed.</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <td>\n                <p>\n                    <b>Reason</b><br />\n                    {{var reason}}\n                </p>\n                <p>\n                    <b>Checkout Type</b><br />\n                    {{var checkoutType}}\n                </p>\n                <p>\n                    <b>Customer:</b><br />\n                    <a href="mailto:{{var customerEmail}}">{{var customer}}</a> &lt;{{var customerEmail}}&gt;\n                </p>\n                <p>\n                    <b>Items</b><br />\n                    {{var items}}\n                </p>\n                <p>\n                    <b>Total:</b><br />\n                    {{var total}}\n                </p>\n                <p>\n                    <b>Billing Address:</b><br />\n                    {{var billingAddress.format(''html'')}}\n                </p>\n                <p>\n                    <b>Shipping Address:</b><br />\n                    {{var shippingAddress.format(''html'')}}\n                </p>\n                <p>\n                    <b>Shipping Method:</b><br />\n                    {{var shippingMethod}}\n                </p>\n                <p>\n                    <b>Payment Method:</b><br />\n                    {{var paymentMethod}}\n                </p>\n                <p>\n                    <b>Date & Time:</b><br />\n                    {{var dateAndTime}}\n                </p>\n            </td>\n        </tr>\n    </tbody>\n</table>', NULL, 2, 'Payment Transaction Failed Reminder', NULL, NULL, NULL, '2013-02-26 07:25:53', NULL, NULL),
(27, 'Protokoll Bereinigung Warnungen (Template)', '\n\nLog Cleanup Warnings:\n\n{{var warnings}}', NULL, 1, 'Log Cleanup Warnings', NULL, NULL, NULL, '2013-02-26 07:25:54', NULL, NULL),
(28, 'Newsletter Anmeldung Bestätigung (Template)', '\n\n\n\n<body style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<div style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<table cellspacing="0" cellpadding="0" border="0" height="100%" width="100%">\n    <tr>\n        <td align="center" valign="top" style="padding:20px 0 20px 0">\n            <!-- [ header starts here] -->\n            <table bgcolor="FFFFFF" cellspacing="0" cellpadding="10" border="0" width="650" style="border:1px solid #E0E0E0;">\n                <tr>\n                    <td valign="top">\n                        <a href="{{store url=""}}" style="color:#1E7EC8;"><img src="{{var logo_url}}" alt="{{var logo_alt}}" border="0"/></a>\n                    </td>\n                </tr>\n                <!-- [ middle starts here] -->\n                <tr>\n                    <td valign="top">\n                        <h1 style="font-size:22px; font-weight:normal; line-height:22px; margin:0 0 11px 0;"">Thank you for subscribing to our newsletter.</h1>\n                        <p style="border:1px solid #E0E0E0; font-size:12px; line-height:16px; margin:0; padding:13px 18px; background:#F9F9F9;">To begin receiving the newsletter, you must first confirm your subscription by clicking on the following link:<br />\n                        <a href="{{var subscriber.getConfirmationLink()}}" style="color:#1E7EC8;">{{var subscriber.getConfirmationLink()}}</a><p>\n                    </td>\n                </tr>\n                <tr>\n                    <td bgcolor="#EAEAEA" align="center" style="background:#EAEAEA; text-align:center;"><center><p style="font-size:12px; margin:0;">Thank you again, <strong>{{var store.getFrontendName()}}</strong></p></center></td>\n                </tr>\n            \n                        \n                        <tr>\n                            <td>\n                                {{block type="germansetup/imprint_content" template="germansetup/imprint/email_footer.phtml"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\n        </td>\n    </tr>\n</table>\n</div>\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, 'Newsletter subscription confirmation', NULL, NULL, NULL, '2013-02-26 07:25:54', NULL, NULL),
(29, 'Newsletter Anmeldung Erfolg (Template)', '\n                        \n                        <tr>\n                            <td>\n                                {{block type="germansetup/imprint_content" template="germansetup/imprint/email_footer.phtml"}}\n                            </td>\n                        </tr>\n                        \n                    \nNewsletter subscription success', NULL, 2, 'Newsletter subscription success', NULL, NULL, NULL, '2013-02-26 07:25:54', NULL, NULL),
(30, 'Newsletter Abmeldung Erfolg (Template)', '\n                        \n                        <tr>\n                            <td>\n                                {{block type="germansetup/imprint_content" template="germansetup/imprint/email_footer.phtml"}}\n                            </td>\n                        </tr>\n                        \n                    \nNewsletter unsubscription success', NULL, 2, 'Newsletter unsubscription success', NULL, NULL, NULL, '2013-02-26 07:25:54', NULL, NULL),
(31, 'Wunschliste gemeinsam nutzen (Template)', '\n\n\n\n<body style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<div style="background:#F6F6F6; font-family:Verdana, Arial, Helvetica, sans-serif; font-size:12px; margin:0; padding:0;">\n<table cellspacing="0" cellpadding="0" border="0" height="100%" width="100%">\n    <tr>\n        <td align="center" valign="top" style="padding:20px 0 20px 0">\n            <!-- [ header starts here] -->\n            <table bgcolor="FFFFFF" cellspacing="0" cellpadding="10" border="0" width="650" style="border:1px solid #E0E0E0;">\n                <tr>\n                    <td valign="top">\n                        <a href="{{store url=""}}" style="color:#1E7EC8;"><img src="{{var logo_url}}" alt="{{var logo_alt}}" border="0"/></a>\n                    </td>\n                </tr>\n                <!-- [ middle starts here] -->\n                <tr>\n                    <td valign="top">\n                        <p style="font-size:12px; line-height:16px; margin:0 0 16px 0;">Hey,<br/>Take a look at my wishlist from {{var store.getFrontendName()}}.</p>\n                        <p style="font-size:12px; line-height:16px; margin:0 0 16px 0;">{{var message}}</p>\n                        {{var items}}\n                        <br/>\n                        {{depend salable}}<p style="font-size:12px; line-height:16px; margin:0 0 8px 0;"><strong><a href="{{var addAllLink}}" style="color:#1E7EC8;">Add all items to shopping cart</a></strong> |{{/depend}} <strong><a href="{{var viewOnSiteLink}}" style="color:#1E7EC8;">View all wishlist items</a></strong></p>\n                    </td>\n                </tr>\n                <tr>\n                    <td bgcolor="#EAEAEA" align="center" style="background:#EAEAEA; text-align:center;"><center><p style="font-size:12px; margin:0;">Thank you, <strong>{{htmlescape var=$customer.name}}</p></center></td>\n                </td>\n            </table>\n        </td>\n    </tr>\n</table>\n</div>\n</body>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, 'Take a look at {{var customer.name}}''s wishlist', NULL, NULL, NULL, '2013-02-26 07:25:55', NULL, NULL),
(32, 'Produkt an einen Freund verschicken (Template)', '\n                        \n                        <tr>\n                            <td>\n                                {{block type="germansetup/imprint_content" template="germansetup/imprint/email_footer.phtml"}}\n                            </td>\n                        </tr>\n                        \n                    \n\n\nWelcome, {{htmlescape var=$name}}<br /><br />Please look at <a href="{{var product_url}}">{{var product_name}}</a><br /><br />Here is message: <br />{{var message}}<br /><br />', NULL, 2, 'Welcome, {{var name}}', NULL, NULL, NULL, '2013-02-26 07:25:55', NULL, NULL),
(33, 'Kontaktformular (Template)', '\n\nName: {{var data.name}}\nE-mail: {{var data.email}}\nTelephone: {{var data.telephone}}\n\nComment: {{var data.comment}}', NULL, 1, 'Contact Form', NULL, NULL, NULL, '2013-02-26 07:25:55', NULL, NULL),
(34, 'Sitemap Generierung Warnungen (Template)', '\n\nSitemap generate warnings:\n\n\n{{var warnings}}', NULL, 1, 'Sitemap generate Warnings', NULL, NULL, NULL, '2013-02-26 07:25:55', NULL, NULL),
(35, 'Produkt wieder verfügbar (Template)', '\n\nHello {{var customerName}},\n\n{{var alertGrid}}', NULL, 2, 'Products back in stock alert', NULL, NULL, NULL, '2013-02-26 07:25:55', NULL, NULL),
(36, 'Produkt Preisänderung (Template)', '\n\nHello {{var customerName}},\n\n{{var alertGrid}}', NULL, 2, 'Products price changed alert', NULL, NULL, NULL, '2013-02-26 07:25:55', NULL, NULL),
(37, 'Produkt Cron Fehler (Template)', '\n\nProduct alerts cron warnings:\n\n{{var warnings}}', NULL, 2, 'Product alerts Cron error', NULL, NULL, NULL, '2013-02-26 07:25:56', NULL, NULL),
(38, 'OAuth Tokenänderung (Template) [Invitation]', '\n\n\nHello, {{htmlescape var=$userName}}<br /><br />\nYour authorization to <b>{{htmlescape var=$applicationName}}</b> has been changed to <b>{{htmlescape var=$status}}</b> by Admin team.<br /><br />\n', NULL, 2, 'Welcome, {{var name}}', NULL, NULL, NULL, '2013-02-26 07:25:56', NULL, NULL);
